INSERT INTO `contents` VALUES (118,NULL,1,NULL,'2021-01-21','Operador de Atendimento',NULL,NULL,'<br><div>Horário de Trabalho: Manhã e Tarde</div><div><span style=\"color: rgb(74, 74, 74); font-family: Lato, sans-serif; font-size: 14px;\">180h mês | Escala 6x1 - folgas variáveis (sábado ou domingo)</span></div><div><br></div><div>Salário:&nbsp; R$ 1.150,00, Benefícios:&nbsp;<span style=\"color: rgb(74, 74, 74); font-family: Lato, sans-serif; font-size: 14px;\">Vale refeição e/ou vale alimentação, Seguro de Vida, Auxílio funeral, Auxílio creche / Criança especial, Desconto em Produtos, Assistência Odontológica, Assistência Médica.</span></div><div><br></div><div><br></div><div>Local: São Paulo/ SP- Limão</div><div><br></div><div>Atividades:&nbsp;&nbsp;<span style=\"color: rgb(74, 74, 74); font-family: Lato, sans-serif; font-size: 14px;\">Atendimento ao cliente por voz (receptivo), com o objetivo de identificar suas necessidades, esclarecer dúvidas e realizar procedimentos em sistema sobre produtos e/ou serviço.Perfil do cliente: Clientes que possuem conta com o banco e tem dúvidas referente ao produto.</span></div><div><br></div><div><br></div><div><br></div><div>Requisitos: Ensino Médio Completo&nbsp;</div><div><br></div><div><br></div><div><span style=\"background-color: yellow;\">VAGA EXCLUSIVA PARA PCDS&nbsp; &nbsp; </span>&nbsp; &nbsp;</div>','https://Inklua.compleo.com.br/Visualizar/72084',NULL,'OPELIMÃO',1,'São Paulo','SP',0,'Não Informada',NULL,NULL,'2021-02-05 17:23:43','2021-07-31 00:00:08'),(194,NULL,1,NULL,'2021-01-08','Auxiliar Selecionamento',NULL,NULL,'<p><span style=\"color: rgb(85, 85, 85); font-weight: 700; background-color: rgb(255, 255, 0);\">VAGA EXCLUSIVA PARA PESSOAS COM DEFICIÊNCIA</span><br>CARGO:&nbsp; Auxiliar Selecionamento</p><p>LOCAL: Ermelino Matarazzo /SP</p><p>ATIVIDADES: efetuar a colocação manual de sacos plásticos de embalagem e proteção dos produtos acabados sempre que necessário e/ou quando de problemas com equipamentos automáticos, seguindo instruções e procedimentos específicos para cada linha de produto; efetuar a amarração manual da paletização dos produtos sempre que necessário utilizando fitas de arqueamento e seguindo instruções e procedimentos específicos para cada linha de produto; retirar e abastecer as linhas de embalagem com os materiais necessários, envolvendo chapatex, pallets, molduras e outros;</p><p>SALÁRIO: R$ 1.498,00</p><p>BENEFÍCIOS: assistência médica, assistência odontológica, PLR, VA, refeitório no local, academia no local, previdência privada, seguro de vida.</p><p>ESCALA:&nbsp; 6x2, podendo ser 1º, 2º ou 3º turno&nbsp;</p><p><span style=\"color: rgb(85, 85, 85); font-weight: 700; background-color: rgb(255, 255, 0);\">VAGA EXCLUSIVA PARA PESSOAS COM DEFICIÊNCIA</span><br></p>','https://Inklua.compleo.com.br/Visualizar/70867',NULL,'70867',1,'Guarulhos','SP',10440,'República',NULL,NULL,'2021-02-05 17:24:44','2021-07-31 00:00:08'),(197,NULL,1,NULL,'2021-01-07','Auxiliar de Produção',NULL,NULL,'<p>Responsável pelo final de linha de produção de bisnagas de tinta, conferir o produto, embalar e enviar para logística.&nbsp;</p><ul type=\"disc\" style=\"margin-top: 0cm;\"></ul><p>Cargo: Auxiliar de Produção</p><p>Local: Cajamar/SP (Fretado para:&nbsp;Várzea Paulista,\r\nJundiaí. Cajamar, Franco da Rocha, Francisco Morato, Caieiras e Santana de\r\nParnaíba)</p><p>Salário: R$9,15/HORA&nbsp;+ Benefícios (VT, Fretado, Convênio\r\nmédico após período de experiência, refeição no local, PPR, cesta básica,\r\nseguro de vida e convênio odontológico.<u5:p></u5:p>)&nbsp;</p><p>Horário: Escala 2x2 12h/dia</p><p>Requisitos:&nbsp;Ensino Médio Completo e desejável experiência com embalagem.</p><p><br></p><p><br></p><div><br></div><p style=\"line-height: 1;\"><span style=\"color: inherit;\"><br></span></p><p style=\"line-height: 1;\"><span style=\"font-weight: bold; background-color: yellow;\">VAGA EXCLUSIVA PCD</span></p><p><br></p>','https://Inklua.compleo.com.br/Visualizar/70796',NULL,'I