13:05','2021-07-31 00:00:08'),(589,NULL,3,NULL,NULL,'Primeira vereadora com síndrome de Down da história do país','Inclusão','RMlFM0iHF1beBYYAZwMqHDKXiPAKLTOSXFcDR7Vk.jpg','<p>Um marco para a pol&iacute;tica brasileira! <br />Luana Rolim, a primeira vereadora com s&iacute;ndrome de Down do pa&iacute;s. Luana atuar&aacute; como membro da c&acirc;mara municipal de Santo &Acirc;ngelo &ndash; RS.&nbsp;</p>','https://istoe.com.br/vereadora-com-sindrome-de-down-toma-posse-em-santo-angelo/','Istoé',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,'2021-03-23 12:50:42','2021-03-23 13:49:24'),(590,NULL,3,NULL,NULL,'Novo sistema de leitura labial','Inclusão','duUBPcJta3VjK4h3KDb5mUH0HHr7zEmZA6J2TvVG.jpg','<p>Cientistas de um laborat&oacute;rio focado no desenvolvimento de ferramentas de acessibilidade para computadores desenvolveram um sistema para leitura labial. O LipType, como foi nomeado, se apoia nas c&acirc;meras de aparelhos e no tratamento de algoritmos para identificar falas e transcrev&ecirc;-las.</p>','https://canaltech.com.br/amp/inovacao/novo-sistema-de-leitura-labial-transcreve-falas-a-partir-da-camera-do-celular-180973/?fbclid=IwAR381aGXPa3tbfqHLodTwHZ4ilTc6MwOJA8QsBvheBztclKo4Iw3cPN_B7A','Canal Tech',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,'2021-03-23 12:59:48','2021-04-07 21:26:09'),(591,NULL,3,NULL,NULL,'Menino Maluquinho recebe novo personagem','Inclusão','0Sjr2SwcEjvRbH6VAI0JoUmpca8gb8zpLpPA4XET.jpg','<p>A Turma do Menino Maluquinho ganhou tr&ecirc;s novos integrantes: Chico, um menino com S&iacute;ndrome de Down e as irm&atilde;s mais novas, Maria Clara e Maria Ant&ocirc;nia. <strong>\"Chico e suas Marias\"</strong> &eacute; um portal de conte&uacute;do e entretenimento que conta o dia a dia das crian&ccedil;as e os desafios da defici&ecirc;ncia intelectual, al&eacute;m de dicas de sa&uacute;de, educa&ccedil;&atilde;o e cultura.</p>','https://paisefilhos.uol.com.br/familia/menino-maluquinho-recebe-novo-personagem-com-sindrome-de-down-na-turma-conheca-mais-sobre-ele/?fbc