;s.</p>','https://brasil.estadao.com.br/blogs/vencer-limites/artista-brasileira-que-pinta-com-os-pes-e-a-boca-e-destaque-em-bienal-na-polonia/','Estadão',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,'2021-04-27 23:30:35','2021-04-27 23:31:07'),(909,NULL,1,NULL,'2021-07-22','Analista Tributário Senior (Obrigações Acessórias)',NULL,NULL,'<p class=\"MsoNormal\">Responsável pela entrega das obrigações acessórias à nível\r\nBrasil; responsável pela entrega do Sped Fiscal (EFD); responsável pelas\r\nentregas das Gias (Todas as Lojas / Cd\'s); fará análises dos campos das\r\nobrigações acessórias a fim de manter compliance com as legislações; fará a\r\nintercessão com o time de apuração a fim de realizar os cruzamentos com as\r\ninformações; atuará com a implementação de projetos (Tax Force); fará a\r\nentrega da Ciap (Ativo Imobilizado ou Permanente); conferência do XML (verificar se as informações estão de acordo com o sistema), entre outras\r\natividades.<o:p></o:p></p><p>CARGO:&nbsp;Analista Tributário\r\nSenior (Obrigações Acessórias)</p><p class=\"MsoNormal\"><o:p></o:p></p><p>LOCAL:&nbsp; São Paulo/SP – modelo hibrido</p><p class=\"MsoNormal\"><o:p></o:p></p><p>HORÁRIO: segunda a quinta – 08:00 as 18:00 e sexta das 08:00 as\r\n17:00. (necessário disponibilidade de horário esporádica para horas complementares)</p><p class=\"MsoNormal\"><o:p></o:p></p><p>SALÁRIO: a combinar + plano odontológico e saúde; cartão cesta básica no valor de R$52,00; VT; cooperativa de crédito (opcional); alimentação no local; convenio com universidades; escola de Idiomas; totalpass/gympass; seguro de Vida +&nbsp;PPR de 0.5 salários</p><p class=\"MsoNormal\"><o:p></o:p></p><p>REQUISITOS: superior completo.&nbsp; Conhecimento Avançado\r\nno Pacote Office, sendo os principais, Excel e Power Point; desejável o\r\nconhecimento com o idioma Inglês (Intermediário); preferencialmente\r\nconhecimento com os sistemas Mastersaff e SAP; desejável conhecimento com o\r\nsistema Consinco; conhecimento com os impostos ICMS, ICMS-ST, IPI; desejável\r\nter atuação no segmento do varejo/atacado.</p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p>','https://Inklua.compleo.com.br/Visualizar/80699',NULL,'80699',1,'São Paulo','SP',10438,'São Bernardo',NULL,NULL,'2021-04-28 17:30:12','2021-07-31 00:00:06'),(910,NULL,3,NULL,NULL,'Conheça Pedro Janot','Inclusão','5CB1BNVXb6uUMFVfbAVqSwEnrs8WeQuNyl4kCpxY.jpg','<p>O executivo, respons&aacute;vel pela vinda da Zara ao Brasil e com passagens por Lojas Americanas, P&atilde;o de A&ccedil;&uacute;car, Richards e Mesbla, ficou parapl&eacute;gico ap&oacute;s sofrer um acidente quando andava a cavalo, em 2011, e decidiu mudar sua carreira. Desacelerou o ritmo e passou a ser conselheiro de empresas e palestrante.</p>','https://economia.uol.com.br/empregos-e-carreiras/noticias/redacao/2021/04/22/os-conselhos-para-o-sucesso-do-ex-presidente-da-azul-e-da-zara-no-brasil.htm','Uol',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,'2021-04-28 18:56:59','2021-04-28 18:56:59'),(922,NULL,3,NULL,NULL,'Time da várzea de SP tem camisa com braille e libras','Inclusão','OsA6SDiAZ6Px4UEoO8KtXoAJT4zYgzLC3jV6pbw0.jpg','<p>O Inajar de Souza, time com 42 anos de hist&oacute;ria no futebol de v&aacute;rzea de S&atilde;o Paulo, lan&ccedil;ou sua nova camisa. A novidade chama aten&ccedil;&atilde;o logo &agrave; primeira vista, porque abaixo do escudo e do logotipo da fornecedora de material esportivo est&aacute; escrito \"Inajar\" de tr&ecirc;s jeitos diferentes: com o alfabeto romano usado na l&iacute;ngua portuguesa; em libras e no alto-relevo do braille.</p>','https://www.uol.com.br/esporte/futebol/ultimas-noticias/2021/04/28/time-da-varzea-de-sp-combate-preconceito-em-camisa-que-tem-ate-braille.htm','Uol',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,'2021-04-29 21:32:06','2021-04-29 21:32:06'),(937,NULL,1,NULL,'2021-04-30','Oficial de Serviços Gerais',NULL,NULL,'<p>Lavagem de bandejas e panelas, limpeza da área de distribuição</p><p><span style=\"font-wei