al.</span></p>','https://Inklua.compleo.com.br/Visualizar/81230',NULL,'81230',1,'São Paulo','SP',0,'Não Informada',NULL,NULL,'2021-05-04 19:45:06','2021-07-31 00:00:08'),(980,13,1,NULL,'2021-07-22','Analista de BI',NULL,NULL,'<p style=\"color: rgb(85, 85, 85);\">Responsável por realizar o levantamento de requisitos com as áreas internas a fim de entender as demandas de soluções em BI que cada departamento necessita; desenho, estruturação e desenvolvimento da solução através de Excel, Power BI e banco de dados SQL - criando relatórios informatizados conforme levantado com as áreas.&nbsp;</p><p style=\"color: rgb(85, 85, 85);\">CARGO: Analisa de BI</p><p style=\"color: rgb(85, 85, 85);\">LOCAL: São Paulo, SP - Zona Sul - Av. Nações Unidas (em home office por tempo indeterminado)&nbsp;</p><p style=\"color: rgb(85, 85, 85);\">ESCALA: de segunda à sexta - 08h às 17h</p><p style=\"\"><span style=\"color: rgb(85, 85, 85);\">SALÁRIO: a combinar + assistência médica: MEDIAL 400 NAC; assistência odontológica: Amil Dental. Refeitório interno; vale alimentação de R$ 92,00; auxílio home office de R$ 100,00 (por tempo determinado); vale transporte ou estacionamento no local; parcerias com academias; convenio com farmácias; seguro de vida; participação nos lucros de até 1,5 salários mediante ao cumprimento das metas estipuladas – pagamento anual.&nbsp;</span></p><div><span style=\"color: rgb(85, 85, 85);\">REQUISITOS: ensino superior completo; excel avançado; conhecimento em Power BI e SQL; experiência na função. Desejável conhecimento em MDX (SSAS, SSIS, SSMS)</span><br></div><p style=\"color: rgb(85, 85, 85);\"><br></p>','https://Inklua.compleo.com.br/Visualizar/81255',NULL,'ANLBISP',1,'São Paulo','SP',10577,'Tech Team Inklua',NULL,NULL,'2021-05-04 22:00:05','2021-07-31 00:00:06'),(985,NULL,3,NULL,NULL,'Enya estampa capa de revista holandesa','Inclusão','1Zojodeo0YnHtxcFE5NKz41mtHzTqy7uSann4F5v.jpg','<p>Enya tem s&iacute;ndrome de Down&nbsp;e quebrou barreiras ao estampar a capa