ução de planos de ação); Manter a comunicação fluindo entre Rock e Clientes (NPS, Follow-ups após ligações e entre QBRs com clientes e Rockers); Busca constantemente oportunidades de aprender algo novo (produtos e processos da Rock, conteúdo / marketing digital, SaaS, etc); Buscar o alinhamento da expectativa do cliente com a entrega da Rock, e constantemente dar feedback para outras equipes (produto, mktplace, serviços, financeiro, jurídico, etc); Registre e organize a comunicação para que os registros do Hubspot estejam 100% atualizados. Acompanhar todos os processos internos dentro do CSM e demais equipes. </p><p class=\"MsoNormal\">(Com um acompanhamento mais próximo da gestão).</p><p class=\"MsoNormal\">CARGO: Associado de sucesso do cliente - Home Office</p><p class=\"MsoNormal\">SALÁRIO:&nbsp;R$3700&nbsp;+ Benefícios</p><p class=\"MsoNormal\">LOCAL:&nbsp;Remoto.<br></p><p class=\"MsoNormal\">Requisitos: graduação em comunicação, administração de empresas ou similar; habilidades intermediárias ou superiores de inglês; conhecimento em marketing digital, inbound marketing e marketing de conteúdo (gestão estratégica digital, email marketing, redes sociais, CRO, SEO, Google Analytics, RD Station, Hubspot, Wordpress); experiência anterior relevante com atendimento ao cliente ou vendas; conhecimento básico do modelo de negócios SaaS.&nbsp;</p><p class=\"MsoNormal\"><br></p>','https://Inklua.compleo.com.br/Visualizar/84977',NULL,'ROCKMKT',1,'São Paulo','SP',10441,'Jundiaí',NULL,NULL,'2021-06-09 21:15:07','2021-07-31 00:00:07'),(1409,NULL,1,NULL,'2021-06-09','Estagiario de Qualidade',NULL,NULL,'<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-right: 14pt; line-height: 150%;\"><span style=\"text-indent: -18pt;\">Acompanhamento das atividades diárias realizadas no setor de qualidade, a</span><span style=\"text-indent: -18pt;\">nálise físico-química de matérias primas e produto acabado, a</span><span style=\"text-indent: -18pt;\">nálises para monitoramento e control