; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></p><p style=\"\">LOCAL: Vila Olímpia&nbsp;- São Paulo</p><p style=\"\">HORÁRIO: á combinar</p><p style=\"\">SALÁRIO: á combinar</p><p style=\"\">BENEFÍCIOS: assistência médica: Sul América - tipo do plano depende do cargo, mas todos privativos + todos sem mensalidade, apenas coparticipação em consultas e exames simples; assistência odonto: Bradesco (mensalidade de R$9,51 ou 24,40 – depende do padrão escolhido); gympass para todos; seguro de vida para todos;&nbsp;VT, se solicitado – desconto padrão de 6% previsto em lei;&nbsp;VR/VA – R$900,00 (como distribuir cada um escolhe a modalidade);PLR (target varia por cargo): assistente = 1sal/ano; analista = 1,9sal/ano.</p><p style=\"\">REQUISITOS: superior cursando; adobe After Efects\r\navançado com foco em motion;&nbsp;Adobe Premiere\r\nintermediário; portfólio\r\natualizado; conhecimento dos\r\nprincípios de design (composição, paleta de cores, hierarquia de informação); conhecimento dos\r\nprincipais formatos de vídeos para redes sociais; excelente\r\ncomunicação verbal e escritas; noção geral de\r\nprodução de vídeo (da captação a pós/finalização); conhecimento dos\r\nprincípios de comunicação (construção de mensagem, valor agregado, canal); olhar refinado para\r\ndireção de arte.</p><p class=\"MsoNormal\"><o:p></o:p></p>','https://Inklua.compleo.com.br/Visualizar/85246',NULL,'85246',1,'São Paulo','SP',10440,'República',NULL,NULL,'2021-06-11 20:00:08','2021-07-31 00:00:07'),(1439,NULL,1,NULL,'2021-06-11','Analista de DHO SR',NULL,NULL,'<p>Atuar como parceiro interno do negócio, na construção de um RH único, plural e&nbsp; colaborativo, suportando a construção de caminhos simples e inteligentes para a entrega da mineração do futuro; desenvolver, implementar e monitorar os processos, programas e projetos de RH, alinhado com a estratégia de pessoas e do negócio; reali