arreira&nbsp;</p><p style=\"\">REQUISITOS: ensino fundamental completo, além de proatividade.&nbsp;</p>','https://Inklua.compleo.com.br/Visualizar/85347',NULL,'BKRJREPOSI',1,'Rio de Janeiro','RJ',10473,'Paulista',NULL,NULL,'2021-06-15 18:15:09','2021-07-31 00:00:07'),(1481,NULL,1,NULL,'2021-06-15','Consultor Projetos PL',NULL,NULL,'<p>Irá Atuar como PMO, sendo responsável pela gestão de escopo, cronograma, partes interessadas, qualidade, status report (time do projeto e executivo), interface com negócio e TI, riscos, aquisições, gestão de mudanças e encerramento, visão de processos para apoio e entendimento do AS-IS e TO-BE para melhor desenho de Escopos, monitorar a execução das atividades dos projetos e definir a melhor estratégia de condução de acordo com prazos, custos e recursos acordados junto aos stakeholders, Participação em reuniões com posicionamento, foco e facilidade em estruturar próximos passos de forma clara, objetiva e formalização através de ATA’s de reunião.</p><p>CARGO:&nbsp; Consultor de Projetos PL&nbsp;</p><p>LOCAL: São Paulo/SP, modelo hibrido.&nbsp;</p><p>HORÁRIO: segunda a sexta, horário comercial.</p><p>SALÁRIO: á combinar</p><p>BENEFÍCIOS: plano odontológico e saúde, multicheque , cartão cesta básica no valor de R$52,00, VT, cooperativa de crédito ( opcional), alimentação no local, convênio com universidades, escola de Idiomas, totalpass/Gympass, seguro de Vida, licença maternidade estendida, cartão mamãe, enxoval do bebê, prêmio por tempo de casa e auxílio Funeral.</p><p>REQUISITOS: experiência profissional em gestão de projetos, Excel, Power Point e Project. desejável: PMP, Scrum, Yellow Belt / Green Belt, pós graduação em gerenciamento de projetos.&nbsp;</p><div><br></div><p></p>','https://Inklua.compleo.com.br/Visualizar/85573',NULL,'CONSPROJPL',1,'','SP',10438,'São Bernardo',NULL,NULL,'2021-06-15 19:00:08','2021-07-31 00:00:07'),(1484,NULL,1,NULL,'2021-07-21','Representante de Desenvolvimento de Vendas Pleno',NULL,NULL,'Será responsável pela qualificação e abordagem inicial.\r\nIrá minerar novos nichos de mercado para buscar o encaixe com Product Market\r\nFit. Irá receber uma lista pronta de leads ou deverá gerar a lista de possíveis\r\noportunidades, deverá se aprofundar em contas principalmente Enterprise. <span lang=\"EN-US\" style=\"\">Realizar abordagem outbound, usando cold e-mail, cold calling, social\r\nselling e networking. </span>Isso tudo, claro, é feito dentro do mindset da venda\r\nconsultiva. Realizar as etapas da cadência de prospecção a fim de conseguir uma\r\nconexão com o lead. Conduzir uma ligação de descoberta inicial, confirmar\r\nnecessidade e verificar o interesse em solucionar o problema existente.\r\nAgendamento de reuniões e passagem da oportunidade para a equipe de vendas.<p></p><p style=\"\">CARGO:&nbsp;&nbsp;Representante de desenvolvimento de vendas</p><p style=\"\">LOCAL: 100% home office</p><p style=\"\">HORÁRIO: á combinar.</p><p style=\"\">SALÁRIO: R$ 4.498,00</p><p class=\"MsoNormal\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></p><p style=\"\">BENEFÍCIOS:&nbsp; vale refeição, vale transporte, assistência médica e odontológica</p><p style=\"\">REQUISITOS: ensino superior cursando, inglês intermediário (ler e responder e-mails) e&nbsp;conhecimento em metodologias de Vendas (SPIN, BANT,\r\nGPCT).</p><p></p>','https://Inklua.compleo.com.br/Visualizar/85579',NULL,'RPDVBRNEO',1,'','',10438,'São Bernardo',NULL,NULL,'2021-06-15 19:30:07','2021-07-31 00:00:06'),(1485,NULL,1,NULL,'2021-05-13','Analista de Inteligência Estatística | Júnior - Pleno.',NULL,NULL,'<br><div style=\"text-align: justify;\"><div style=\"text-align: left;\"><p style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased;\"><span data-mce-style=\"box-sizing: border-box; -webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; font-family: helvetica, arial, sans-serif; font-size: 10pt;\" style=\"transition: all 0.2s ease-in-out 0s; -webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased;\">Esse profissional irá gerir, criar e dar manutenção aos indicadores; atender padrões de entrega de serviços, manipulação de dados usando ferramentas como SQL e/ou R/ Python, gerenciamento de risco de fraude e afins.&nbsp;</span></p></div><div style=\"\"><br></div><div style=\"\">CARGO:&nbsp;<span style=\"text-align: center;\">Analista de Inteligência Estatística</span><br></div></div><p style=\"\">LOCAL: Barra Funda - São Paulo/SP - Home Office durante a pandemia&nbsp;</p><p style=\"\">HORÁRIO:&nbsp;<span style=\"text-align: justify;\">Segunda a sexta, das 09h às 18h</span></p><p style=\"\">SALÁRIO: A combinar</p><p style=\"\">BENEFÍCIOS: participação nos Lucros e Resultados de até 3,4 Salários/ ano, VR ou VA,&nbsp;Auxílio creche para crianças até 5 anos; Seguro de Vida em grupo;&nbsp;GymPass, Sesc,&nbsp;Cartão Multibenefícios – (com desconto na compra de diversos itens na rede credenciada, incluindo medicamentos em diversas redes de farmácias); assistência média; convênio odontológico. diferenciais: flexibilidade de horário; aulas de teatro; política educacional para graduação e pós-graduação; programa eu saudável (acompanhamento de saúde e Bem-Estar); programa primeiros laços (acompanhamento gestacional); consultas médicas remotas; palestras de desenvolvimento pessoal e profissional.&nbsp;</p><p style=\"\">REQUISITOS: ensino superior completo, experiência com análise de dados, conceitos estatísticos e&nbsp;<span style=\"text-align: justify;\">ferramentas de programação (SQL, Python ou R); excel. diferencial: Inglês, conhecimento em prevenção de fraudes e análise de riscos.&nbsp;</span></p>','https://Inklua.compleo.com.br/Visualizar/82291',NULL,'CS002',1,'São Paulo','SP',10577,'Tech Team Inklua',NULL,NULL,'2021-06-15 19:30:09','2021