der de produto da tribo para definir a visão do domínio, OKR\'s e estratégia de entrega de longo prazo que atendam aos padrões organizacionais, de segurança, regulatórios, legais e técnicos; apoiar, investir e desenvolver uma equipe incrível de engenheiros talentosos e motivados, com expectativas claras por meio de práticas como 1:1\'s, estabelecimento de metas e feedback constante; construir uma cultura de engenharia de primeira linha em colaboração com a liderança funcional (principais engenheiros, treinadores ágeis, etc.); realizar a gestão das pessoas e de carreira dos profissionais CLT (atuando em tarefas como prover feedback, gestão de férias, desenvolvimento do PAD - Plano de Auto Desenvolvimento, aplicar advertências, entre outros); auxiliar na gestão dos profissionais terceirizados (fábrica e PJ) de seus squads, atuando em processos como substituição de profissionais e concessão de acessos (na ausência de um líder parceiro no squad); confirmar as horas trabalhadas no mês dos profissionais de fábrica (prévia de pagamento às fábricas); garantir que a base de head count (HC) da tecnologia esteja refletindo a realidade dos profissionais de seu squad; responsável pela gestão da fila de incidentes direcionados ao squad; ajudar os squads e remover bloqueios para evitar impactos em entregas; acompanhar indicadores do squad e elaborar planos de ação para melhoria dos mesmos; facilitar a cooperação e comunicação entre todos squads da tribo e times externos; identificar falhas e evoluir os processos de gestão dentro de sua tribo; apoiar seus squads a serem mais eficientes, com qualidade e entregas nos prazos determinados, sempre alinhando com o PM;&nbsp;</p><p></p><p style=\"\">CARGO: Team Leader | Pleno - Sênior.&nbsp;</p><p style=\"\">LOCAL: São Caetano do Sul, São Paulo, Brasil.&nbsp;</p><p style=\"\">HORÁRIO: à combinar.</p><p style=\"\">SALÁRIO: à combinar.</p><p style=\"\">BENEFÍCIOS: restaurante no local / vale alimentação; assistência médica e odontológica; PR