,NULL,NULL,NULL,'2021-06-25 17:38:04','2021-06-25 17:38:04'),(1616,NULL,1,NULL,'2021-06-25','Tech Lead - Java | Pleno - Sênior',NULL,NULL,'<p>Consiga se comunicar de maneira clara tanto com pessoas técnicas quanto não técnicas; lidere e mentore demais engenheiros do time; esteja próximo à gestão para dar apoio em pautas técnicas; esteja próximo à área de produtos para viabilizar tecnicamente as ideias; construa equipes de alto desempenho; crie micro serviços altamente concorrentes, usando uma variedade de linguagens de programação nas plataformas Java e .Net; projete RESTful e API\'s e arquiteturas orientadas a eventos; construa aplicações usando os princípios de orientações à objetos e design patterns; entregue aplicações resilientes, com baixa latência, usando princípios de programação reativa; crie dashboards intuitivos para monitoramento; investigue bugs e exceptions reportadas em produção; conduza testes integrados de carga e stress; nos ajude a construir nossa cultura de agilidade.&nbsp;</p><p></p><p style=\"\">CARGO: Tech Lead - Java | Pleno - Sênior.&nbsp;</p><p style=\"\">LOCAL: São Caetano do Sul, São Paulo, Brasil.&nbsp;&nbsp;</p><p style=\"\">HORÁRIO: à combinar.&nbsp;</p><p style=\"\">SALÁRIO: à combinar.&nbsp;</p><p style=\"\">BENEFÍCIOS: restaurante no local / vale alimentação; assistência médica e odontológica; PLR / bônus; bicicletário; licenças maternidade e paternidade estendidas; desconto em produtos; espaço saúde (academia, acupuntura, pilates, etc.); dresscode: seja você.&nbsp;</p><p style=\"\">REQUISITOS: tem atitude de dono e proatividade; aprende rápido; tem bons conhecimentos em algoritmos e estrutura de dados; já trabalhou em cultura ágil (Scrum, Kanban, Lean); gosta de desafios e debates; está familiarizado com a mensageria assíncrona (com Kafta, RabbitMQ ou similares); tem conhecimentos sólidos em bases de dados SQL e NoSQL; entende o teorema de CAP e consistência eventual; entende o conceito de Change Data Capture e Offload de Mainframe; é resiliente e flexível, pois estamos no processo de transformação digital.&nbsp;</p><p></p>','https://Inklua.compleo.com.br/Visualizar/86760',NULL,'VV016',1,'São Caetano do Sul','SP',10577,'Tech Team Inklua',NULL,NULL,'2021-06-25 20:45:10','2021-07-31 00:00:07'),(1620,18,1,NULL,'2021-06-28','Agile Project - Infraestrutura | Pleno - Sênior',NULL,NULL,'<p>Liderar inceptions e plannings de projetos e iniciativas; determinar e definir o escopo e os objetivos do projeto e mapear os riscos e restrições; prever recursos necessários para alcançar objetivos e gerenciar recursos de maneira eficiente; preparar business case de orçamento com base no escopo de trabalho e nos requisitos de recursos; gerenciar o orçamento do projeto para cumprir os custos e reportar o Latest estimate (LE) e mensalmente; desenvolver e gerenciar um cronograma detalhado do projeto e um plano de trabalho; fornecer atualizações do projeto de maneira consistente e várias partes interessadas sobre estratégia, ajustes e progresso; gerenciar aquisições e contratos com fornecedores atribuindo tarefas e comunicando os resultados esperados junto aos departamentos responsáveis; utilizar as melhores práticas, técnicas e padrões ágeis em toda a execução do projeto; monitorar o progresso, solucionar os problemas e fazer os ajustes necessários; liderar iniciativas de transformação digital em infraestrutura; ser um verdadeiro ninja em resolução de conflitos; navegar em todas as equipes de T.I, levando às necessidades, envolvendo as pessoas, compartilhando os riscos e garantindo os alinhamentos necessários para execução das iniciativas e projetos; atuar como integrador e superconnector; identificar oportunidades e necessidades para contribuir na melhoria dos processos.&nbsp;</p><p></p><p style=\"\">CARGO: Agile Project - Infraestrutura | Plano - Sênior.</p><p style=\"\">LOCAL: São Caetano do Sul, São Paulo, Brasil.&nbsp;</p><p style=\"\">HORÁRIO: à combinar.&nbsp;</p><p style=\"\">SALÁRIO: á combinar.&nbsp;</p><p