imentos em Java, Spring Frameworks\r\n(Boot, Data, JPA, Security, Batch e outros), conceitos de Design Patterns,\r\nSOLID, Clean Code e Clean Architecture, arquitetura de Microservices e Event\r\nSourcing; DevOps, CI/CD, conhecimentos em Cloud AWS (S3, EC2, ECS, Lambda, RDS,\r\nDynamoDB).</p><p class=\"MsoNormal\" style=\"text-align:justify\"><o:p></o:p></p>','https://Inklua.compleo.com.br/Visualizar/86939',NULL,'DESENVALEL',1,'','',10473,'Paulista',NULL,NULL,'2021-06-28 22:00:21','2021-07-31 00:00:07'),(1638,NULL,1,NULL,'2021-06-29','Atendente de Locação',NULL,NULL,'<br><p class=\"MsoNormal\">Atendimento ao cliente, vender a locação dos carros e\r\nseguros, entrega do veículo.<o:p></o:p></p><p></p><p style=\"\">CARGO: Atendente de Locação</p><p style=\"\">LOCAL:&nbsp;Shopping Barra Sul\r\n– Porto Alegre/RS</p><p style=\"\">HORÁRIO: escala 6x1 horário a combinar dentre as 8h as 22h</p><p style=\"\">SALÁRIO: R$ 1650,00</p><p style=\"\">BENEFÍCIOS:&nbsp;assistência médica, assistência odontológica, vale refeição R$ 23,00 o dia e vale transporte.</p><p style=\"\">REQUISITOS:&nbsp;ensino Médio completo, CNH categoria: B, experiência com vendas e atendimento ao cliente será um diferencial.</p><p></p>','https://Inklua.compleo.com.br/Visualizar/86980',NULL,'ATLOCMOPOA',1,'Porto Alegre','RS',10438,'São Bernardo',NULL,NULL,'2021-06-29 13:30:05','2021-07-31 00:00:07'),(1639,NULL,1,NULL,'2021-06-29','Vendedor',NULL,NULL,'<br><div>Irá atuar com vendas externas.</div><div><br></div><div>CARGO: Vendedor</div><div><br></div><div>LOCAL: Porto Alegre/RS</div><div><br></div><div>HORÁRIO: de segunda a sábado, das 07h ás 15:20.</div><div><br></div><div>SALÁRIO:&nbsp; 1408,97 fixo + comissão variável que pode chegar a 1400,00</div><div><br></div><div>BENEFICIOS: Vale combustível, Vale refeição de R$19,57 ao mês, Vale Alimentação R$192,49 ao mês, Plano Médico Unimed, Plano odontológico Metlife e Seguro de Vida.</div><div><br></div><div><br></div><div>REQUISITOS: ensino médio completo; CN