MsoNormal\">Vagas <span style=\"font-weight: bold;\">exclusivas para profissionais com deficiência</span> em áreas operacionais e técnicas, e que estejam em busca do primeiro emprego.&nbsp;&nbsp;</p><p class=\"MsoNormal\">Consideramos profissionais de<span style=\"font-weight: bold;\">&nbsp;Barão de Cocais, Santa Bárbara e Catas Altas.&nbsp;</span></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\"><span style=\"text-decoration-line: underline; font-weight: bold;\">Cadastre seu currículo.&nbsp;</span></p><p><br></p><p class=\"MsoNormal\" style=\"text-indent: 35.4pt;\"><o:p></o:p></p><p><br></p>','https://Inklua.compleo.com.br/Visualizar/87127',NULL,'87127',1,'Mariana','MG',10439,'Rio de Janeiro / Minas Gerais',NULL,NULL,'2021-06-29 21:00:23','2021-07-31 00:00:07'),(1651,NULL,1,NULL,'2021-06-29','Software Engineering | Specialist II',NULL,NULL,'<p>Gerenciar a estratégia técnica de evolução do domínio e suas dependências técnicas visando minimizar o débito técnico; responsável pela liderança técnica da tribo fazendo parte de todo ciclo de desenvolvimento; atuar como mentor através de seus conhecimentos técnicos e de liderança; desenhar soluções de novos produtos e estratégias de evoluções dos produtos existentes; trabalhar de forma colaborativa com os times com foco sempre em nossos clientes; utilizar novas tecnologias para alavancar as entregas melhorar a experiência dos clientes; identifica dependências e trabalha com outros squads afim de resolvê-las o quanto antes; propõe soluções definitivas para problemas recorrentes; demonstrar comportamentos que incentivam a cultura DeSecOps e a atitude pragmática da engenharia de software; envolver-se no recrutamento de novos engenheiros e iniciativas para fortalecer a marca da nossa equipe de engenharia.&nbsp;</p><p></p><p style=\"\">CARGO: Software Engineering | Specialist II.&nbsp;</p><p style=\"\">LOCAL: São Caetano do Sul, São Paulo, Brasil.&nbsp;</p><p style=\"\">HORÁRIO: à combinar.</p><p style=\"\">SALÁRIO: à combinar.&nbsp;</p><p style=\"\">BENEFÍCIOS: vale refeição; assistência médica e odontológica; bônus; previdência privada; bicicletário; licenças maternidade e paternidade estendidas; desconto em produtos; espaço saúde (academia, acupuntura, pilates e etc.); dresscode: seja você.&nbsp;</p><p style=\"\">REQUISITOS: dominar Java 8, framework spring; arquitetura de micro serviços; Domain Driven Design (DDD); event sourcing; padrões de autenticação e autorização; gestão ágil de projetos; processos de Change Data Captures (CDC) e reaplicação de dados; sistemas de mensageria (Apache Kafka, RabbitMQ, ActiveMQ); OpenAPI Specification; conceitos DevOps (esteira, ferramentas, pipelines); conteinerização com docker; container registry; orquestração de containers (Kubernetes, Openshift); plataformas cloud (Azure, AWS, GCP); banco de dados relacionais (Oracle, SQLServer, etc.); banco de dados noSQL (MongoDB).&nbsp;</p><p></p>','https://Inklua.compleo.com.br/Visualizar/87132',NULL,'VV018',1,'São Caetano do Sul','SP',10577,'Tech Team Inklua',NULL,NULL,'2021-06-29 21:15:05','2021-07-31 00:00:07'),(1653,NULL,3,NULL,NULL,'Ele treina a seleção brasileira de futsal Down e hoje é campeão mundial','Inclusão','JCA5RqG8j5dI8TLmD6aZWg38j0zRaXr6JTdN53AY.webp','<p>Com a pandemia, a sele&ccedil;&atilde;o tem feito treinos online para se preparar para a pr&oacute;xima competi&ccedil;&atilde;o, que acontecer&aacute; em 2022 no Peru. Cleiton tem investido em aulas te&oacute;ricas para que os atletas possam conhecer a hist&oacute;ria do esporte e debater o estilo de jogo das outras equipes que ir&atilde;o enfrentar.</p>','https://www.uol.com.br/ecoa/ultimas-noticias/2021/05/17/a-historia-do-tecnico-que-criou-a-selecao-brasileira-de-futsal-down.htm?fbclid=IwAR32iQCdlVEhqf59U7Jp4QfgBbnpBOgXUcdNyGsZezEMu8S0_eIYy9psmsA','UOL',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,'2021-06-29 21:22:16','2021-06-29 21:22:16'),(1657,NULL,1,NULL,'2021-06-30','Quality Assurance | Specialist',NULL,NULL,'<p>Acompanhar a impleme