R\">Vai liderar e apoiar a implementação\r\ndos principais componentes da nuvem e documentar detalhes críticos de design e\r\nconfiguração para dar suporte às iniciativas corporativas de nuvem.</span> <span style=\"border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm\">&nbsp;Lidar com equipes\r\nmultidisciplinares de alto desempenho, envolvendo analistas de infraestrutura,\r\ndesenvolvedores, segurança da informação e atendimento aos usuários finais.</span>\r\n<span style=\"border:none windowtext 1.0pt;mso-border-alt:none windowtext 0cm;\r\npadding:0cm\">Coordenar melhorias e esforços de implantação para a implementação\r\nde soluções para as áreas de negócio trabalhando em estreita colaboração com\r\noutras equipes.</span> <span style=\"border:none windowtext 1.0pt;mso-border-alt:\r\nnone windowtext 0cm;padding:0cm\">Suportar as áreas de negócios sobre\r\nestratégias para implantação de novas tecnologias em nuvem e otimização de\r\ntecnologias existentes.</span> <span style=\"border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm\">Otimização dos custos de\r\nlicenciamentos e das soluções em nuvem, identificando o desperdício e\r\nautomatizando o gerenciamento de custos na nuvem além de documentar os projetos\r\ntécnicos.</span> <span style=\"border:none windowtext 1.0pt;mso-border-alt:none windowtext 0cm;\r\npadding:0cm\">Atuar nos serviços de TI e Governança Corporativa com foco em\r\ncapacidade, monitoração, arquitetura, continuidade de negócio.</span> <span style=\"border:none windowtext 1.0pt;mso-border-alt:none windowtext 0cm;\r\npadding:0cm\">Avaliar novas tecnologias, participação em projetos com foco em\r\navaliar capacidade do ambiente e necessidade de crescimento.</span> <span style=\"border:none windowtext 1.0pt;mso-border-alt:none windowtext 0cm;\r\npadding:0cm\">Administrar a infraestrutura e ambientes em cloud, envolvendo o\r\nplanejamento, provisionamento “as code”, segurança e automação, utilizando\r\nconceitos de DevSecOps.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify\">CARGO: Especialista de Infraestrutura</p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify\"><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify\">SALÁRIO: á combinar<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify\">HORÁRIO: comercial | seg á sexta<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify\">LOCAL: Barueri/SP | Home Office<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify\">BENEFÍCIOS:&nbsp;PPR anual (até 4\r\nsalários), previdência privada, vale refeição, vale alimentação, assistência\r\nmédica e odontológica, seguro de vida, auxílio creche e babá, ajuda de custo\r\npara deslocamento, auxílio medicamentos, ajuda de custo home office, cartão\r\ncultura, gympass, parceria com plataforma online para saúde mental.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify\">REQUISITOS: Identificar pontos de\r\nmelhoria na infraestrutura de TI para redução de custos; Experiência com\r\nplanejamento e gestão de projetos de Infraestrutura; Facilidade para\r\nidentificar e implementar oportunidades de melhorias e automação de processos e\r\nredução de custos; Sólida experiência e conhecimento em infraestrutura Cloud e\r\nprovisionamento “as code”, e conhecimento das práticas recomendadas para alta\r\ndisponibilidade, escalabilidade, resiliência, desempenho e requisitos de\r\nsegurança na nuvem. Vasta experiência na implementação e configuração de\r\nserviços em nuvem, em diversas tecnologias; Profundo conhecimento e experiencia\r\ncomo Devops em nuvem AWS, administração e configuração. CI/CD em AWS e Azure\r\nDevops; Sólidos conhecimentos em gestão de múltiplos ambientes usando\r\nmetodologia Release-Train, Versionamentos e merges. Desejável Formação\r\nAcadêmica em Tecnologia ou áreas correlatas.<o:p></o:p></p>','https://Inklua.compleo.com.br/Visualizar/88611',NULL,'INFRAALELO',1,'Barueri','SP',10473,'Paulista',NULL,NULL,'2021-07-14 12:30:05','2021-07-31 00:00:06'),(1834,NULL,1,NULL,'2021-07-14','Repositor',NULL,NULL,'<p style=\"color: rgb(85, 85, 85);\">Realizará atendimento ao cliente, reposição e organização de mercadorias nas gôndolas, entre outras atividades de rotina.</p><p style=\"color: rgb(85, 85, 85);\">CARGO: Repositor</p><p style=\"color: rgb(85, 85, 85);\">LOCAL: Belo horizonte/MG</p><p style=\"color: rgb(85, 85, 85);\">SALÁRIO: R$ 1.229,32</p><p style=\"color: rgb(85, 85, 85);\">HORÁRIO: 13h00 às 22h00 | Escala 6x1<br></p><p style=\"color: rgb(85, 85, 85);\">BENEFÍCIOS: vale refeição, cesta básica ou vale alimentação de acordo com a região, assistência médica e odontológica, café da manhã, convênio com o senac e vale Transporte.</p><p style=\"color: rgb(85, 85, 85);\">REQUISITOS: ensino fundamental completo.</p>','https://Inklua.compleo.com.br/Visualizar/88624',NULL,'REPOSCOBAS',1,'Belo Horizonte','MG',10473,'Paulista',NULL,NULL,'2021-07-14 13:00:12','2021-07-31 00:00:06'),(1835,NULL,1,NULL,'2021-07-14','Auxiliar de Produção',NULL,NULL,'<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:7.5pt;margin-left:0cm\">Auxiliar\r\nna fabricação de louças - produção.</p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:7.5pt;margin-left:0cm\">CARGO:&nbsp;Auxiliar de produção</p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:7.5pt;margin-left:0cm\">LOCAL: Queimados, RJ.</p><p style=\"margin:0cm;vertical-align:baseline\"><o:p></o:p></p><p style=\"margin: 0cm; vertical-align: baseline;\">SALÁRIO: R$ 6,43h/220h - R$1.414,00&nbsp;</p><p style=\"margin: 0cm; vertical-align: baseline;\"><br></p><p style=\"margin: 0cm; vertical-align: baseline;\">HORÁRIO