 ferramentas de visualização de dados (Data Studio / PowerBI; Técnicas de\r\nmodelagem, assim como análise exploratória de dados para fornecer insights,\r\nidentificar tendências e medir desempenho , correlações, clusterização; conhecimento\r\nem linguagem de programação SQL e criação de querys otimizadas - conhecimento\r\npara operar banco de dados para tratamento e análise de dados; diferenciais: experiência\r\ncom criação e manutenção de Data Lake/Data Warehouse e processos de ETL.</span></p>\r\n\r\n<p></p>','https://Inklua.compleo.com.br/Visualizar/88281',NULL,'HP002',1,'','',10577,'Tech Team Inklua',NULL,NULL,'2021-07-14 13:30:10','2021-07-31 00:00:07'),(1840,NULL,1,NULL,'2021-07-14','Oficial de Serviços Gerais',NULL,NULL,'<br><p><span style=\"color: rgb(99, 99, 99);\">O profissional irá realizar limpeza e organização de ambientes externo e interno.<br></span></p><p><span style=\"color: rgb(99, 99, 99);\">CARGO: Oficial de Serviços Gerais<br></span></p><p style=\"\"><span style=\"color: rgb(99, 99, 99);\">LOCAL: São Bernardo do Campo/SP</span></p><p style=\"\"><span style=\"color: rgb(99, 99, 99);\">HORÁRIO: horário 7 ás 19hr</span></p><p style=\"\"><span style=\"color: rgb(99, 99, 99);\">SALÁRIO: R$ 1.336,16</span></p><p style=\"\"><span style=\"color: rgb(99, 99, 99);\">BENEFÍCIOS:&nbsp;convênio médico, convênio odontológico, vale alimentação e vale transporte.&nbsp;</span></p><p style=\"\"><span style=\"color: rgb(99, 99, 99);\">REQUISITOS:&nbsp;ensino fundamental completo</span></p><p></p>','https://Inklua.compleo.com.br/Visualizar/88639',NULL,'OFGSSBC',1,'São Bernardo do Campo','SP',10438,'São Bernardo',NULL,NULL,'2021-07-14 13:45:07','2021-07-31 00:00:06'),(1841,NULL,1,NULL,'2021-07-14','Analista de Customer Service (SAC)',NULL,NULL,'<p>O profissional irá atuar com esclarecimento de dúvidas de clientes, registro e tratativa de reclamações de clientes, posicionar o cliente quanto a entrega dos materiais quando solicitado, atualizar o cliente sobre as datas previstas de faturamento; preenchimento de planilhas, análise crítica das ocorrências e retorno das áreas antes de enviar ao cliente.</p><p>CARGO: Analista de Customer Service (SAC)<br></p><p style=\"\">LOCAL: Chácara Aeroporto - Jundiaí/SP</p><p style=\"\">HORÁRIO: segunda a sexta das 08h às 18h</p><p style=\"\">SALÁRIO:&nbsp;R$ 2.437,00</p><p style=\"\">BENEFÍCIOS: assistência médica, assistência odontológica, seguro de vida, vale refeição ou vale alimentação, previdência privada, alimentação no local, PLR e bolsa de idiomas (após 1 ano).</p><p style=\"\">REQUISITOS:&nbsp;técnico ou superior cursando Engenharia, Química, Administração, Contabilidade ou áreas correlatas; experiência na área de atendimento ao cliente, call center, SAC etc.; conhecimentos básicos em Office. Desejável conhecimentos básicos em inglês e/ou espanhol. Necessário ter internet e espaço físico para trabalhar em Home Office.</p><p></p>','https://Inklua.compleo.com.br/Visualizar/88640',NULL,'HEXANALSAC',1,'Jundiaí','SP',10473,'Paulista',NULL,NULL,'2021-07-14 13:45:07','2021-07-31 00:00:06'),(1842,NULL,1,NULL,'2021-07-14','Analista de Dados | Junior',NULL,NULL,'<p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Open Sans&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\">Gerar e\r\nmanter reports e dashboards para as áreas do Zoop Revenue Office (Sales and\r\nCustomer Sucess); Realizar análises dos principais indicadores do funil de\r\nvendas, sendo capaz de identificar gargalos e suportando a tomada de decisão da\r\ndiretoria; Desenvolver modelos preditivos que contribuam para a uma melhor\r\ngestão da atividade comercial; Padronizar e documentar indicadores da operação\r\ncomercial; Zelar pela integridade dos dados analisados e apresentados.</span></p>\r\n\r\n<p><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <