lientes, irá realizar a cobrança sobre&nbsp; a situação dos carregamentos e sobre o envio dos caminhões. Irá fazer relatórios diariamente para o acompanhamento do fluxo e status para o cliente, indicadores. Acompanhar e garantir que todas as viagens planejadas sejam realizadas e identificar pontos de melhorias.<br></span></p><p><span style=\"color: rgb(99, 99, 99);\">CARGO: Assistente de Logística<br></span></p><p style=\"\"><span style=\"color: rgb(99, 99, 99);\">LOCAL:&nbsp; São José dos Campos/SP</span></p><p style=\"\"><span style=\"color: rgb(99, 99, 99);\">HORÁRIO:&nbsp;turno 6 x1, segunda e sexta das 14:00 as 22:00 e ter, quarta, quinta e sábado das 16h as 22:00</span></p><p style=\"\"><span style=\"color: rgb(99, 99, 99);\">SALÁRIO: R$ 2.743,00</span></p><p style=\"\"><span style=\"color: rgb(99, 99, 99);\">BENEFÍCIOS:&nbsp;convênio médico e odontológico com coparticipação se utilizar, previdência privada, VT, VR de 35$, participação de lucros.&nbsp;</span></p><p style=\"\"><span style=\"color: rgb(99, 99, 99);\">REQUISITOS:&nbsp;ensino médio completo, excel intermediário a avançado, experiência mínima de 1 ano na área de transportes em logística, desejável: superior completo, conhecimento SAP</span></p><p></p>','https://Inklua.compleo.com.br/Visualizar/88678',NULL,'ASSISLOGSJ',1,'São José dos Campos','SP',10438,'São Bernardo',NULL,NULL,'2021-07-14 16:00:16','2021-07-31 00:00:06'),(1846,NULL,1,NULL,'2021-07-14','Oportunidades para profissionais de áreas operacionais em Mariana e Ouro Preto - MG',NULL,NULL,'<p class=\"MsoNormal\">Vagas <span style=\"font-weight: bold;\">exclusivas para profissionais com deficiência</span> em áreas operacionais e técnicas, e que estejam em busca do primeiro emprego.&nbsp;&nbsp;</p><p class=\"MsoNormal\">Consideramos profissionais de&nbsp;<span style=\"font-weight: bold;\">Mariana e Ouro Preto.&nbsp;</span></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\"><span style=\"text-decoration-line: underline; font-weight: bold;