o total semanal dedicado a aperfeiçoamento e \r\nliberdade para se vestir como quiser.</p><p style=\"\">REQUISITOS: Pelo menos 2 anos de experiência com testes automatizados de software; Experiência com SQL; Vontade de assumir responsabilidades e trabalhar com autonomia; Preocupação com a qualidade das entregas; Interesse por aprimorar processos/rotinas; Gosto por aprender e ensinar.<br></p><p></p>','https://Inklua.compleo.com.br/Visualizar/88736',NULL,'PRS002',1,'','',10577,'Tech Team Inklua',NULL,NULL,'2021-07-14 18:45:06','2021-07-31 00:00:06'),(1858,NULL,1,NULL,'2021-07-07','Gerente do laboratório de controle de qualidade Sr.',NULL,NULL,'<p class=\"MsoNormal\">Garantir que produtos seguros sejam liberados para os pacientes e gerenciar a transferência do método analítico garantindo a estratégia para o lançamento de novos produtos e gerenciamento do ciclo de vida do produto. Gerenciar as operações do Laboratório de Qualidade do País, para garantir a conformidade das atividades do laboratório e dos sistemas de qualidade associados com os requisitos do Manual de Qualidade da empresa e todos os requisitos regulamentares e legislativos relevantes ao longo do ciclo de vida dos produtos.<br></p><p class=\"MsoNormal\">CARGO: AS&amp;T Region Americas Hub Head &amp; QC Lab\r\nBrasil Head (gerente sênior do laboratório de controle de\r\nqualidade)</p><p class=\"MsoNormal\">LOCAL: Santo Amaro - SP (Inicialmente, Home Office)&nbsp;</p><p class=\"MsoNormal\">ESCALA: regime de trabalho flexível – Horário\r\ncomercial, horários que tem preferência. <o:p></o:p></p><p class=\"MsoNormal\">SALÁRIO: a combinar</p><p class=\"MsoNormal\">BENEFÍCIOS: bônus anual, plano de pensão, seguro de\r\nvida, recesso de fim de ano, dia de folga de aniversário, licença maternidade e\r\npaternidade, refeitório subsidiado, seguro saúde e odontológico, empregado\r\nesquema de reconhecimento, estacionamento gratuito (Santo Amaro e Cambe),\r\nGympass, Espaço Energizado para a Vida, academia (Santo Amaro