centivo Educação com auxílio de 50% do valor pago e\r\nAuxílio creche para mães com filhos até 12 meses R$ 408,00 mensais.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Open Sans&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\">ATIVIDADES:&nbsp;Responsável\r\npela qualificação e abordagem inicial. Irá minerar novos nichos de mercado para\r\nbuscar o encaixe com Product Market Fit. Irá receber uma lista pronta de leads\r\nou deverá gerar a lista de possíveis oportunidades, deverá se aprofundar em\r\ncontas principalmente Enterprise. Realizar abordagem outbound, social selling e\r\nnetworking. Isso tudo, claro, é feito dentro do mindset da venda consultiva.\r\nRealizar as etapas da cadência de prospecção a fim de conseguir uma conexão com\r\no lead. Conduzir uma ligação de descoberta inicial, confirmar necessidade e\r\nverificar o interesse em solucionar o problema existente. Agendamento de\r\nreuniões e passagem da oportunidade para a equipe de vendas.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Open Sans&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\">REQUISITOS:&nbsp;&nbsp;Inglês\r\n(Intermediário) para troca de e-mails; Experiência preferencialmente em\r\nempresas SaaS B2B; Habilidade e interesse por interação comercial a partir de\r\nligações ativas.</span></p>\r\n\r\n<p style=\"color: rgb(85, 85, 85);\"><span style=\"font-weight: 700; background-color: rgb(255, 255, 0);\">VAGA EXCLUSIVA PARA PESSOAS COM DEFICIÊNCIA</span></p>','https://Inklua.compleo.com.br/Visualizar/77513',NULL,'NG005',1,'Joinville','SC',10577,'Tech Team Inklua',NULL,NULL,'2021-07-15 14:15:08','2021-07-31 00:00:08'),(1866,NULL,1,NULL,'