ntações, book de resultados e report\r\nsemanal; apoio nos processos de contratações (requisições, cotações e\r\npedidos) no sistema SAP;&nbsp;Apoio no processo de conferência dos documentos\r\nfiscais, analisando os relatórios de inconsistências (documentos e informações\r\ndas requisições e pedidos) e fazer as correções necessárias junto aos\r\nresponsáveis; prestar suporte aos assistentes administrativos da área.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal\"><span style=\"font-size: 10pt; font-family: &quot;Open Sans&quot;, sans-serif;\">CARGO: Analista\r\nAdministrativo Jr. Foco em Obras<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal\"><span style=\"font-size: 10pt; font-family: &quot;Open Sans&quot;, sans-serif;\">LOCAL:&nbsp;-\r\nShopping Interlar Aricanduva - Avenida Aricanduva, 5555<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal\"><span style=\"font-size: 10pt; font-family: &quot;Open Sans&quot;, sans-serif;\">ESCALA: Segunda a\r\nSexta - A combinar<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal\"><span style=\"font-size: 10pt; font-family: &quot;Open Sans&quot;, sans-serif;\">SALÁRIO:\r\nR$&nbsp;3.034,29.&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal\"><span style=\"font-size: 10pt; font-family: &quot;Open Sans&quot;, sans-serif;\">BENEFÍCIOS:\r\nassistência médica, assistência odontológica, seguro de vida, multicheque, 5%\r\nde desconto no valor total de compras realizadas nas lojas do grupo, refeição\r\nna empresa, estacionamento nas dependências, cartão cesta básica no valor de R$\r\n52,00/mês. Após o 3º mês de empresa, sem custo para o colaborador, cooperativa\r\nde crédito com participação mensal de&nbsp; R$ 1,00 mais 1% do salário limitado\r\na R$ 100,00 por mês. Colaboradores associado