t;Open Sans&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\"><br></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\">REQUISITOS: <span style=\"font-size:10.0pt;font-family:&quot;Open Sans&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\">Experiência\r\nem ASP.NET, C#, Windows Services, MVC, SQL Server e WEBAPI. Desejável\r\nexperiência na ferramenta: Microsoft&nbsp;Azure DevOps. Conhecimento em banco\r\nde dados: SQL Server (Procedure, Function, Triggers e Viewes). Conhecimento em\r\ncamada de apresentação: HTML, CSS, JavaScript, JQuery e BootStrap. Diferencial\r\npara a vaga: .NET Core, Azure, GIT, Domain Driven Design, Design Patterns, UML,\r\nArquitetura e Documentação</span></p>\r\n\r\n<p></p>','https://Inklua.compleo.com.br/Visualizar/89167',NULL,'CS003',1,'','',10577,'Tech Team Inklua',NULL,NULL,'2021-07-19 15:15:06','2021-07-31 00:00:06'),(1894,12,1,9,'2021-06-08','Desenvolvedor (a) Back End Full',NULL,NULL,'<p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\">Irá participar de todas as fases do design de produto de alto impacto, analisando os\r\nrequisitos e propondo soluções que agreguem valor a área técnica e de negócios, colaborar nas definições de arquitetura e escalabilidade dos nossos produtos, garantir a qualidade do código. Identificar e propor melhores práticas para Back End, participando da definição do\r\nprojeto, revisão do código, testes e manutenção.<br></p><div><br></div><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\">CARGO: Desenvolvedor (a) Back End Full&nbsp;</p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\"><br></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\">SALÁRIO: á combinar&nbsp;</p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\"><br></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\">HORÁRIO: comercial&nbsp;</p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\"><br></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\">BENEFÍCIOS:&nbsp;AM, AO (Bradesco), VA, refeitório no local, VT, (academia no local ou subsídio de R$ 110,00 ou seja, se o candidato não quiser fazer academia no local e quiser praticar esporte em outro local há esse reembolso), previdência privada, vale de R$100,00 reais na cafeteria da empresa e sala de massagem.</p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\"><br></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\">REQUISITOS:&nbsp; superior completa em engenharia da computação, ciências da computação ou carreiras relacionadas a Tecnologia, experiência prévia com desenvolvimento Back End em ambientes de alto desempenho e escalabilidade, experiência com tecnologias como Java, Go, Groovy, Golang, NodeJS, APIs REST, Git, New Relic, entre outras, possuir experiência em bancos de dados relacionais e NoSQL, além de já ter atuado em ambientes de nuvem.</p><div><br></div>','https://Inklua.compleo.com.br/Visualizar/84844',NULL,'ML002',1,'','',10577,'Tech Team Inklua',NULL,NULL,'2021-07-19 15:15:07','2021-07-31 00:00:07'),(1895,NULL,1,NULL,'2021-06-08','Desenvolvedor Front End | Pleno-Sênior',NULL,NULL,'<p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\">Irá participar do ciclo completo de desenvolvimento de produtos, construir sistemas frontend eficientes e escaláveis, colaborar na geração de novos produtos, junto a designers e engenheiros de Software, com o objetivo de propor e desenvolver soluções para as áreas técnicas e de negócios, identificar e indicar as melhores práticas para frontend, participando da definição o projeto, da revisão do código, dos testes e da manutenção.</p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\"><br></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\">CARGO:&nbsp;Desenvolvedor Front End |Pleno - Sênior <br></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\"><br></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\">SALÁRIO: á combinar&nbsp;</p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\"><br></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\">HORÁRIO: comercial&nbsp;</p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\"><br></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\">BENEFÍCIOS:&nbsp;AM, AO (Bradesco), VA, refeitório no local, VT, (academia no local ou subsídio de R$ 110,00 ou seja, se o candidato não quiser fazer academia no local e quiser praticar esporte em outro local há esse reembolso), previdência privada, vale de R$100,00 reais na cafeteria da empresa e sala de massagem</p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\"><br></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\">REQUISITOS: Formado ou cursando superior em Engenharia da Computação, Ciências da\r\nComputação ou carreiras relacionadas com a tecnologia. Contar com experiência no desenvolvimento front-end em ambientes de alto\r\ndesempenho e escalabilidade. Ter trabalhado com tecnologias web abertas, como JavaScript, HTML e CSS e\r\npossuir conhecimentos sobre NodeJS e React são diferencias.</p><div><br></div>','https://Inklua.compleo.com.br/Visualizar/84846',NULL,'ML001',1,'','',10577,'Tech Team Inklua',NULL,NULL,'2021-07-19 15:15:07','2021-07-31 00:00:07'),(1896,NULL,1,NULL,'2021-03-26','Desenvolvedor Xamarin',NULL,NULL,'<br><p>Desenvolvimento em Xamarin/.NET/C# para celulares, com projetos internos para a companhia e de outsourcing para clientes. Reunião com clientes e equipe para alinhamento&nbsp;<br></p><p style=\"\">CARGO:&nbsp;Xamarin Developer Pleno/Senior</p><p class=\"MsoNormal\"><o:p></o:p></p><p style=\"\">LOCAL: Florianópolis/SC ou remoto</p><p style=\"\">SALÁRIO: A Combinar + benefícios</p><p style=\"\">HORÁRIO:&nbsp;Segunda a sexta – horário comercial (flexível)</p><p style=\"\">REQUISITOS:&nbsp;Superior completo. Conhecimento e experiência em linguagem .NET e C# ou Xamarin. Inglês Avanç<span style=\"color: rgb(85, 85, 85); font-family: Arial; font-size: 14px;\">ado (conversação)</span></p>','https://Inklua.compleo.com.br/Visualizar/78040',NULL,'ART003',1,'Florianópolis','SC',10577,'Tech Team Inklua',NULL,NULL,'2021-07-19 15:15:08','2021-07-31 00:00:08'),(1897,NULL,1,NULL,'2021-03-26','Full Stack Developer',NULL,NULL,'<br><p>Desenvolvimento\r\nfull-stack de aplicações WEB utilizando linguagens ReactJS, Node, PHP, Angular\r\nou VueJS, com projetos internos para a companhia e de outsourcing para\r\nclientes. Reunião com clientes e equipe para alinhamento&nbsp;<br></p><p style=\"\">CARGO:&nbsp;Full Stack Developer</p><p class=\"MsoNormal\"><o:p></o:p></p><p style=\"\">LOCAL: Florianópolis/SC ou remoto</p><p style=\"\">SALÁRIO: A combinar + benefícios</p><p style=\"\">HORÁRIO:&nbsp;Segunda a sexta – horário comercial (flexível)</p><p style=\"\">REQUISITOS:&nbsp;Superior completo. Conhecimento e experiência em linguagem em ReactJS, Node, PHP, Angular ou VueJS. Inglês avançado (conversação)</p>','https://Inklua.compleo.com.br/Visualizar/78041',NULL,'ART001',1,'Florianópolis','SC',10577,'Tech Team Inklua',NULL,NULL,'2021-07-19 15:15:08','2021-07-31 00:00:08'),(1898,NULL,1,NULL,'2021-03-26','Android Developer',NULL,NULL,'<br><p>Desenvolvimento\r\nfull-stack de aplicações Android utilizando linguagens Kotlin, com projetos\r\ninternos para a companhia e de outsourcing para clientes. Reunião com clientes\r\ne equipe para alinhamento&nbsp;<br></p><p style=\"\">CARGO:&nbsp;Android Developer</p><p class=\"MsoNormal\"><o:p></o:p></p><p style=\"\">LOCAL: Florianópolis/SC ou remoto</p><p style=\"\">SALÁRIO: A combinar + benefícios</p><p style=\"\">HORÁRIO:&nbsp;Segunda a sexta – horário Comercial (flexível)</p><p style=\"\">REQUISITOS:&nbsp;Superior completo. Conhecimento e experiência em linguagem Kotlin. Inglês Avançado (conversação)</p>','https://Inklua.compleo.com.br/Visualizar/78042',NULL,'ART002',1,'Florianópolis','SC',10577,'Tech Team Inklua',NULL,NULL,'2021-07-19 15:15:08','2021-07-31 00:00:08');
INSERT INTO `contents` VALUES (1899,NULL,1,NULL,'2021-07-19','Analista de Testes | Junior',NULL,NULL,'<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Open Sans&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\">Planejamento, Modelagem e execução de casos de testes (manuais), entendimento de requisitos de negócios e\r\nespecificações, gerenciamento do ciclo de vida de teste em cada release, geração\r\nde massa de teste (Real ou Mock), gestão de testes regressivos. Apoiar o time e\r\ncriticar o produto com foco na tecnologia e no negócio, criação de esteiras\r\nautomatizadas, codificação de Script de testes (Básico) e automação de testes\r\n(Básico).</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Open Sans&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\"><br></span></p>\r\n\r\n<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG></o:AllowPNG>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves></w:TrackMoves>\r\n  <w:TrackFormatting></w:TrackFormatting>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning></w:PunctuationKerning>\r\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\r\n  <w:LidThemeOther>PT-BR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables></w:BreakWrappedTables>\r\n   <w:SnapToGridInCell></w