"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13.3333px;\">PLR (participação nos lucros e resultados); vale-refeição ou vale alimentação; auxílio creche para crianças até 5 anos; seguro de vida em grupo; gymPass (planos a partir de 29,90/ mês)*; Sesc; cartão multibenefícios – (com desconto na compra de diversos itens na rede credenciada, incluindo medicamentos em diversas redes de farmácias); assistência médica e odontológica&nbsp; – Amil;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13.3333px;\"><br></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\">REQUISITOS: e<span style=\"font-size:10.0pt;font-family:&quot;Open Sans&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\">xperiência em disciplina de qualidade de software; experiência com ferramentas de ciclo de vida de testes e defeitos; experiência com utilização e manipulação de queries SQL (Básico); experiência\r\ncom lógica de programação. Diferencial: ferramentas de apoio / automação\r\n(SoapUI / JMeter / Postman/ Selenium/ Ruby/ Cypress); AzureDevops; API; metodologias\r\nágeis (Scrum / Kanban / Lean); esteira DEVOPS (CI/CD).</span></p>\r\n\r\n<p></p>','https://Inklua.compleo.com.br/Visualizar/89169',NULL,'CS005',1,'','',10577,'Tech Team Inklua',NULL,NULL,'2021-07-19 15:30:06','2021-07-31 00:00:06'),(1902,NULL,1,NULL,'2021-07-15','Operador de loja',NULL,NULL,'O profissional irá atuar com atendimento ao cliente em todos os setores da loja, organização, precificação de mercadorias nas gôndolas, verificação de validade e controle de estoque.<p></p><p style=\"\">CARGO:&nbsp; Operador de loja</p><p style=\"\">LOCAL:&nbsp; Brasília/DF</p><p style=\"\">HORÁRIO: escala 6x1 10h ás 18h</p><p style=\"\">SALÁRIO: R$ 1.231,82</p><p style=\"\">BENEFÍCIOS:&nbsp;assistência médica, assistência odontológica, vale refeição e vale transporte.</p><p style=\"\">REQUISITOS:&nbsp; ensino fundamental completo.</p><p></p>','https://Inklua.compleo.com.br/Visualizar/88888',NULL,'374432DF',1,'Brasília','DF',10438,'São Bernardo',NULL,NULL,'2021-07-19 15:45:06','2021-07-31 00:00:06'),(1903,NULL,1,NULL,'2021-06-18','Caixa',NULL,NULL,'<br><p><br></p><p></p><p style=\"color: rgb(85, 85, 85);\">Prestar serviços de atendimento aos clientes do posto, recebimento de pagamento e organização do local.</p><p style=\"color: rgb(85, 85, 85);\">CARGO: Caixa</p><p style=\"color: rgb(85, 85, 85);\">LOCAL: Teresinha/PI</p><p style=\"color: rgb(85, 85, 85);\">SALÁRIO:&nbsp;1.100,00</p><p style=\"color: rgb(85, 85, 85);\">HORÁRIO: escala 6x1 - 11hr as 19:20hr com 1 hora de almoço.<br></p><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"64\" style=\"width: 48pt;\"><tbody><tr height=\"19\" style=\"height:14.4pt\">\r\n  <td height=\"19\" class=\"xl66\" width=\"64\" style=\"height:14.4pt;width:48pt\"><br></td></tr></tbody></table><p style=\"color: rgb(85, 85, 85);\">BENEFICIOS: seguro de vida, assistência médica, assistência odontológica, extensão da licença maternidade, enxoval do bebê, cartão da mamãe, refeição no local de trabalho, vale alimentação, vale transporte, cartão multicheque, cooperativa de crédito (participantes da cooperativa possuem descontos exclusivos com empresas parceiras, desconto de até R$350 para compra de óculos e lente de contato, desconto para compra de aparelhos corretivos e custo zero para colaborador e dependentes para conclusão do ensino fundamental e médio – formato EAD) e plano de carreira.</p><p class=\"MsoNormal\" style=\"color: rgb(85, 85, 85);\"><o:p></o:p></p><p style=\"color: rgb(85, 85, 85);\">REQUISITOS: ensino fundamental completo e maior de 18 anos de idade.&nbsp;</p><p></p>','https://Inklua.compleo.com.br/Visualizar/86001',NULL,'381357TRSI',1,'Teresina','PI',10438,'São Bernardo',NULL,NULL,'2021-07-19 15:45:07','2021-07-31 00:00:07'),(1904,NULL,1,NULL,'2021-07-19','Coordenador(a) de Tecnologia da Informação | Pleno',NULL,NULL,'<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span style=\"font-size:10.0pt;font-family:&quot;Open Sans&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\">Liderar\r\nequipes de desenvolvimento ágeis;</span>&nbsp;garantir que as entregas ocorram com o\r\nescopo e prazo esperado; fazer a ponte com outras tribos/squads para\r\nalinhar dependências; garantir a boa comunicação entre a equipe e o time\r\nde negócios, com o intuito de ter entregas ágeis, efetivas e eficientes; planejar junto ao time as entregas ao longo das Sprints; disseminar a\r\nadoção de práticas ágeis/mindset ágil; ser o agente e estimulador de\r\nmelhoria contínua; promove o aprendizado do time; direcionar necessidade\r\nde apoio externo ao time; gerir riscos e impedimentos das entregas; gerar e acompanhar o time na tomada de decisão baseada nas métricas de\r\nprodutividade, qualidade e eficácia; realizar a capacitação do time para\r\nidentificar gargalos nos processos através de indicadores ágeis; atuar\r\ncomo facilitador da squad e remover impedimentos; direcionar a evolução\r\nda tecnologia e garantir o uso das melhores práticas para o desenvolvimento de\r\nsoftware. apoiar projetos estruturantes e de transformação digital; suportar a equipe de desenvolvimento para a aplicação de padrões e boas\r\npráticas de desenvolvimento, dados e segurança; elaborar materiais\r\nexecutivos e apresentar temas em comitês executivos; gerenciar elementos\r\nde arquitetura em um plano estratégico de TI; entender os aspectos-chave\r\ne diferenciais do negócio; apoiar processos de aquisição de soluções e\r\nseleção de fornecedores (RFP); suportar o desenvolvimento de roadmap\r\nevolutivo de soluções e destinar o nível de maturidade dos processos de\r\narquitetura.</p>\r\n\r\n<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG></o: