livros</span><span style=\"font-size: 10pt; font-family: Arial, sans-serif;\">.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\"><br></span><span style=\"font-size:10.0pt;font-family:&quot;Open Sans&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\">REQUISITOS: p<span style=\"font-size:10.0pt;font-family:&quot;Open Sans&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\">ossuir\r\nskills de liderança, experiência em gestão de times de TI é considerado um\r\ndiferencial;</span>&nbsp;experiência na atuação de projetos que utilizam métodos\r\nágeis; Background técnico, possuindo conhecimento e interesse em\r\ntecnologia; tenha conhecimento em técnicas de facilitação, team building\r\ne resolução de problemas; ter uma comunicação clara e objetiva, com\r\nfacilidade de falar em público; experiência em projetos de\r\ndesenvolvimento de sistemas, envolvendo várias equipes/fornecedores; conhecimento\r\ndas tendências de TI no mercado educacional; conhecimento de técnicas e\r\nmetodologias de desenvolvimento (lean, agile, Azure devops); perfil dinâmico,\r\ncomunicativo e disruptivo.</p>\r\n\r\n<p></p>','https://Inklua.compleo.com.br/Visualizar/89173',NULL,'FTD001',1,'','',10577,'Tech Team Inklua',NULL,NULL,'2021-07-19 16:00:09','2021-07-31 00:00:06'),(1905,NULL,1,NULL,'2021-07-19','Analista de Infraestrutura | Sênior',NULL,NULL,'<p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal;\">Coordenar\r\ne direcionar a equipe de infraestrutura e suporte de T.I, visando maior\r\nagilidade dos processos, segurança da informação e alta disponibilidade através\r\nde discussões internas, pesquisas, Inovação, metodologia e boas práticas\r\nadotadas; Atuar na Gestão das Pessoas da equipe com avaliações frequentes\r\nindividuais, auxiliando no direcionamento de tarefas e carreiras, organizando\r\nas férias de cada membro da equipe; Administrar contratos e qualidade de\r\nprestação de serviços de links, licenciamento de softwares, terceirização de\r\nserviços/consultorias; Disponibilizar serviços de acordo com as necessidades\r\ndos usuários/clientes; Entender e propôs melhorias nas rotinas realizadas pelos\r\nusuários/clientes; Garantir a conectividade segura entre todos os\r\nestabelecimentos bem como o desempenho, mantendo e aprimorando as configurações\r\ne equipamentos de rede como switches, roteadores, firewall, e outros, através\r\nde análises e gráficos de desempenho; Planejar e desenvolver novos projetos no\r\nambiente de rede da empresa através de ferramental próprio ou de terceiros\r\nmediante contratação de serviços de consultoria; Evitar interrupções na rede de\r\nservidores, garantindo o funcionamento dos mesmos através de manutenções\r\npreventivas ou corretivas quando necessário, a fim de não parar os serviços\r\nprestados pelo setor; Executar e aprimorar planos de contingência na rede de\r\ncomputadores através de equipamentos reserva e sistemas de backups, visando\r\nalta disponibilidade do sistema e redução dos custos com tempo parado dos\r\ndepartamentos usuários; Assegurar e aprimorar os processos de backup de forma a\r\ngarantir a eficiência no sentido de armazenar realmente o conteúdo que\r\ninteressa pelo tempo que for necessário de acordo com a pré-definição elaborada\r\ncom as áreas usuárias, visando pronto restabelecimento das informações quando\r\nsolicitadas; Aplicar / rever e propor novas normas de segurança de TI nas\r\ninstalações dos equipamentos e sistemas da rede, bem como normas gerais de\r\nacesso aos equipamentos e de proteção dos dados, visando garantir a segurança,\r\ncontinuidade e qualidade dos serviços prestados, através de análise dos\r\nrelatórios de controle e acesso; &nbsp;Pesquisar,\r\nestudar e homologar os softwares e computadores disponíveis no mercado de\r\nacordo com a necessidade apontada pela gerência, visando melhorar a qualidade\r\ndos serviços prestados pela área, bem como otimizar sua utilização; Coordenar e\r\nacompanhar a confecção e controle de toda a documentação de redes e servidores,\r\nbem como seus serviços, visando a disponibilidade das informações e histórico\r\nquando necessárias; Assegurar o correto funcionamento de um sistema de Vídeo conferência\r\nentre as unidades, visando permitir comunicação visual entre os colaboradores\r\ndurante reuniões; Apoiar os Distribuidores fornecendo orientações quanto ao\r\nacesso ao e-mail da FTD e conectividade à nossa rede e sistemas, quando\r\nnecessário.</p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal;\"><br></p><p>CARGO: Analista de Infraestrutura</p><p style=\"\">LOCAL: São Paulo/SP - Remoto<br></p><p style=\"\">HORÁRIO: á combinar<br></p><p style=\"\">SALÁRIO:&nbsp; á combinar</p><p class=\"MsoNormal\" style=\"line-height: normal;\">BENEFÍCIOS: v<span style=\"text-align: justify;\">ale refeição ou alimentação (Sodexo);</span><span style=\"text-align: justify;\">&nbsp;p</span><span style=\"text-align: justify;\">lano de saúde central nacional Unimed;</span><span style=\"text-align: justify;\">&nbsp;p</span><span style=\"text-align: justify;\">lano odontológico;</span><span style=\"text-align: justify;\">&nbsp;p</span><span style=\"text-align: justify;\">sicologia Viva: cuide sua saúde mental!; seguro de vida; gympass; 40% de desconto em livros</span><span style=\"text-align: justify;\">.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal;\">REQUISITOS: superior completo, desejável pós-graduação ou MBA</p>\r\n\r\n<p></p><p></p>','https://Inklua.compleo.com.br/Visualizar/89174',NULL,'FTD002',1,