(1919,NULL,1,NULL,'2021-07-16','Oficial de Serviços Gerais',NULL,NULL,'<p class=\"MsoNormal\">Realiza\r\nlimpeza do restaurante, cozinha e áreas de armazenamento, responsável pela\r\nlimpeza de utensílios&nbsp;de produção e\r\ndistribuição (cubas, panelas, pratos, talheres, e alguns equipamentos ).&nbsp;<u5:p></u5:p><br></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\">CARGO: Oficial de serviços gerais<o:p></o:p></p><p class=\"MsoNormal\">LOCAL:&nbsp;Duque de Caxias, RJ</p><p class=\"MsoNormal\">HORÁRIO: Escala 6x1 - segunda a sábado</p><p class=\"MsoNormal\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">SALÁRIO R$1.433,70</p><p class=\"MsoNormal\">BENEFÍCIOS: VT, VA, plano de saúde após período de experiência.</p><p class=\"MsoNormal\">REQUISITO: Ensino médio completo.&nbsp;</p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p>','https://Inklua.compleo.com.br/Visualizar/89047',NULL,'LIMPDUQCAX',1,'Duque de Caxias','RJ',10439,'Rio de Janeiro / Minas Gerais',NULL,NULL,'2021-07-19 18:45:06','2021-07-31 00:00:06'),(1922,14,1,10,'2021-07-19','Analista de Arquitetura | Sênior',NULL,NULL,'<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Open Sans&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\">Alinhar\r\nas necessidades do negócio com a tecnologia, baseado em padrões e melhores\r\npráticas de mercado. Encaminhar a melhor proposta de solução, visando a transformação\r\ndigital e evolução saudável do ambiente, apoiar decisões executivas quanto à\r\nadoção de tecnologias, definição de soluções e análise de cenários. Fazer\r\nanálise crítica de requisitos funcionais, apoiar projetos estruturantes e de\r\ntransformação digital. Suportar a equipe de desenvolvimento para a aplicação de\r\npadrões e boas práticas, gerenciar elementos de arquitetura em um plano\r\nestratégico de TI. Entender os aspectos chave e diferenciais do negócio, apoiar\r\nprocessos de aquisição de soluções e seleção de fornecedores (RFP). Executar\r\nprovas de conceito, definir soluções para exigências funcionais e não\r\nfuncionais. Suportar o desenvolvimento de roadmap evolutivo de soluções e gerir\r\no nível de maturidade dos processos de arquitetura. Definir blueprints e\r\nimplementações de referência, criar e revisar especificações técnicas, cenários\r\nde testes unitários/sistemas das APIs e serviços de integração, com objetivo de\r\nentregarmos soluções com alto nível de qualidade. Validar entregáveis de desenvolvimento\r\nde testes unitários/sistemas automatizados. </span></p>\r\n\r\n<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG></o:AllowPNG>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves></w:TrackMoves>\r\n  <w:TrackFormatting></w:TrackFormatting>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning></w:PunctuationKerning>\r\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\r\n  <w:LidThemeOther>PT-BR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables></w:BreakWrappedTables>\r\n   <w:SnapToGridInCell></w:SnapToGridInCell>\r\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\r\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\r\n   <w:DontGrowAutofit></w:DontGrowAutofit>\r\n   <w:SplitPgBreakAndParaMark></w:SplitPgBreakAndParaMark>\r\n   <w:EnableOpenTypeKerning></w:EnableOpenTypeKerning>\r\n   <w:DontFlipMirrorIndents></w:DontFlipM