. Gympass;\r\n40% de desconto em livros da FTD.</span></p>\r\n\r\n<p style=\"\"><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Tabela normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\">REQUISITOS: e<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 10pt;\">xperiência\r\nem arquitetura de soluções, desenvolvimento e integração de sistemas (Micro\r\nServiços). Boa capacidade de comunicação e apresentação, experiência em\r\nprojetos de desenvolvimento de sistemas, envolvendo várias\r\nequipes/fornecedores, experiência em desenho de arquitetura corporativa e\r\nimplementação de camada de integração orientada a micro serviços e dados. Conhecimento\r\ndas tendências de TI no mercado Educacional, conhecimento em arquitetura\r\nMicrosoft Azure, conhecimento em Framework e </span><span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13.3333px;\">tecnológicas</span><span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 10pt;\">&nbsp;de integração de sistemas. Ter uma visão de arquitetura TOGAF (Frameworks e Patterns), Business\r\nCapability Model, SCRUM (Métodos ágeis), engenharia de software (JAVA, NODE, bancos de dados, NOSQL, API), gestão do código (GIT) e modelagem de software\r\nusando UML, experiência com CRM (canais de vendas e atendimento), integração de sistemas, especificação de APIs, construção de APIs (Microsoft\r\nAPI Manager e WSO2), Azure Service Bus, REST, Java (Springboot), Azure Event\r\nHub, Cache Redis, Stream Analytics, banco de dados SQL e NoSql. Conhecimento de\r\ntécnicas e metodologias de desenvolvimento (agile, devops), noções de\r\nsegurança, cloud (privada e pública) e big data.</span></p>\r\n\r\n<p style=\"\"><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Tabela normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--></p><p></p>','https://Inklua.compleo.com.br/Visualizar/89239',NULL,'FTD003',1,'','',10577,'Tech Team Inklua',NULL,NULL,'2021-07-19 20:00:09','2021-07-31 00:00:06'),(1923,NULL,1,NULL,'2021-07-19','Analista Desenvolvedor Web | Sênior',NULL,NULL,'<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\">Responderá\r\npelo desenvolvimento de soluções sistêmicas; responderá pela qualidade do\r\ncódigo, testes e entregas; apoiará na revisão e definição de novos\r\npadrões&nbsp;de desenvolvimento; irá apoiar&nbsp;a implementação e revisão\r\nde projetos&nbsp;