atin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--><p>CARGO: Especialista DevOps<br></p><p style=\"\">LOCAL: São Paulo/Remoto<br></p><p style=\"\">HORÁRIO: á combinar<br></p><p style=\"\">SALÁRIO: á combinar<br></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\">BENEFÍCIOS: v<span style=\"font-size:10.0pt;font-family:&quot;Open Sans&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\">ale refeição ou alimentação (Sodexo); plano de saúde central nacional Unimed; plano odontológico; psicologia viva: cuide da sua saúde mental!; seguro de vida; Gympass;\r\n40% de desconto em livros da FTD.</span></p>\r\n\r\n<p style=\"\"><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Tabela normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\">REQUISITOS: c<span style=\"font-size:10.0pt;font-family:&quot;Open Sans&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PT-BR\">onhecimento\r\nem AWS CGP e Azure (Multicloud), experiência em Linux, Docker, kubernetes,\r\nRancher, automatização de processos e scripts, habilidade para criar e\r\ngerenciar esteiras CI/CD utilizando as principais ferramentas de mercado como\r\nJenkins, Azure DevOps é diferencial. Conhecimento em sistemas desenvolvidos em\r\nmicroserviços, conhecimento em Ansible, Terraform, Cloud Formation, conhecimento\r\nem soluções de monitoramento como&nbsp;Prometheus, Zabbix, Grafana, APP Insigth\r\ne soluções de APM similares. Lidar com troubleshooting junto as áreas de Infra\r\ne DevOps, ser participativo e propor novas ideias e soluções, bom\r\nrelacionamento e trabalho em equipe, disseminar a cultura DevOps. Formação\r\nSuperior em áreas relacionadas a TI (Análise de sistemas, ciência da\r\ncomputação, Adm. De redes e afins).</span></p>\r\n\r\n<p style=\"\"><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Tabela normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--></p><p></p>','https://Inklua.compleo.com.br/Visualizar/89245',NULL,'FTD005',1,'','',10577,'Tech Team Inklua',NULL,NULL,'2021-07-19 20:15:05','2021-07-31 00:00:06'),(1925,NULL,1,NULL,'2021-07-14','Assistente administrativo',NULL,NULL,'<p>Acompanhar a Implantação a solução contratada de acordo com os requisitos definidos com cliente, a fim de que o cliente possa acionar os serviços prestados e a empresa inicie o controle do parque instalado promovendo receita dos contratos e monitorar os atendimentos referentes a chamado técnico, controlando o cumprimento do SLA estabelecido em contrato, assegurando qualidade no atendimento para o equipamento danificado;</p><p><br></p><p>CARGO: Assistente Administrativo&nbsp;</p><p>LOCAL: Santana de Parnaíba - SP (inicialmente, home office)&nbsp;</p><p>ESCALA: seg. a sex | 8:00 as 18:00</p><p>SALÁRIO: R$1783,72</p><p>BENEFÍCIOS: assistência médica, assistência odontológica, vale refeição, seguro de vida e PLR de até 4 salários.</p><p>REQUISITOS: ensino médio completo, pacote office intermediário, Conhecimento em Excel sendo (fórmulas e Procv).</p>','https://Inklua.compleo.com.br/Visualizar/88743',NULL,'SIMPASSADM',1,'Santana de Parnaíba','SP',10473,'Paulista',NULL,NULL,'2021-07-19 20:15:05','2021-07-31 00:00:06'),(1926,NULL,1,NULL,'2021-07-19','Especialista de Sistemas',NULL,NULL,'<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\">Responderá pelo desenvolvimento e validação de soluções sistêmicas, entregas do time (qualidade do código, testes e entregas). Apoiará e responderá pela revisão e definição de novos padrões de desenvolvimento. Irá apoiar a implementação e revisão de projetos estruturantes, revisar e implementar processos para eficiência operacional. Apoiará a tomada de decisões junto aos times (squads) de cada produto e na sustentação de aplicações legadas e novos projetos.<br></p>\r\n\r\n<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG></o:AllowPNG>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves></w:TrackMoves>\r\n  <w:TrackFormatting></w:TrackFormatting>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning></w:PunctuationKerning>\r\n  <w:Vali