iscal, cadastros de produtos e clientes, auxiliando na efetivação dos pedidos e cotações de vendas, garantir o envio dos arquivos magnéticos mensais às unidades da federação (operações de entradas e saídas) das filiais com maiores complexidades de operações, por meio dos sistemas EFD ICMS/IPI, EFD Contribuições, Reinf, efetuar o cadastro de natureza de operação no sistema, complementando com as devidas incidências tributárias, conferir guias de tributos apurados e obrigações acessórias como: GIA, DCTF, DES, GNRE, DARF, GARES, efetuar constantes pesquisas de atualização da legislação fiscal para garantir a correta aplicação;&nbsp;&nbsp;&nbsp;Participar de reuniões com coordenadora/gerentes a cerca de operações da companhia, propor melhorias de processos e implantação de procedimentos.</p><p>CARGO: Analista Fiscal Tributário Sênior<br></p><p style=\"\">LOCAL:&nbsp; São Paulo -&nbsp; Home Office<br></p><p style=\"\">HORÁRIO: segunda a sexta-feira\r\n     das 08h às 17h</p><ul style=\"margin-top:0cm\" type=\"disc\">\r\n</ul><p style=\"\">SALÁRIO:&nbsp;R$ 6.613,61<br></p><p style=\"\">BENEFÍCIOS: assistência médica:\r\nMEDIAL 400 NAC Desconto mensal: R$ 64,28 por vida; coparticipação: consulta\r\neletiva R$ 14,00, consulta em P.S. R$ 28,00, exames básicos R$ 3,00, exames\r\ncomplexos R$ 30,00, procedimentos básicos R$ 8,00; assistência odontológica:\r\nAmil Dental (optativo) – Planos que variam de R$ 11,29 à R$51,70; auxílio Home office R$\r\n100,00 – Por tempo determinado; cartão alimentação: R$\r\n92,00; total Pass– Parcerias com\r\nacademias (optativo) – Planos que variam de R$ R$ 79,90 à R$ 399,90; convenio com Farmácias; seguro de Vida</p><p style=\"\">REQUISITOS: ter superior completo em ciências Contábeis , administração, economia ou áreas correlacionadas; excel Avançado; conhecimento em elaboração e entrega de obrigações acessórias (EFD ICMS/IPI, GIA, EFD CONTRIBUIÇÕES, DCTF, REINF, PERDCOMP).</p><p style=\"margin-bottom: 0px;\"><br style=\"color: rgb(74, 74, 74)