zamento: 1 folga entre segunda e sexta-feira e domingos alternados.</p><p style=\"\">SALÁRIO: R$1.541,00</p><p style=\"\">REQUISITOS: Ensino fundamental completo; Disponibilidade de horário.</p><p style=\"color: rgb(85, 85, 85);\"><br></p><p></p>','https://Inklua.compleo.com.br/Visualizar/90077',NULL,'COBASINEUM',1,'Blumenau','SC',10441,'Jundiaí',NULL,NULL,'2021-07-26 22:45:15','2021-07-31 00:00:06'),(2035,NULL,1,NULL,'2021-07-26','Gerente de Contabilidade',NULL,NULL,'<p class=\"MsoNormal\" style=\"\">Responsável por monitorar as\r\npráticas gerais de contabilidade, orçamentar e desenvolver controles contábeis\r\ninternos. Gerenciar as operações contábeis do dia a dia e auxiliar outras áreas\r\ncom questões de investimentos e fiscais. Garantir um processo de fechamento\r\nmensal, trimestral e anual preciso e oportuno. Supervisionar a equipe da razão\r\ngeral para garantir que todos os prazos de relatórios financeiros sejam\r\ncumpridos. Revisar e monitorar os custos inerentes ao negócio. Estabelecer e\r\naplicar métodos, políticas e princípios contábeis adequados. Coordenar e\r\nconcluir auditorias anuais. Responder a consultas do diretor de finanças a\r\nrespeito de resultados financeiros, solicitações de relatórios especiais e\r\nsimilares. Estabelecer e manter arquivos e registros fiscais para documentar as\r\ntransações; coordenar pesquisas de várias questões tributárias; Reconhecer,\r\nantecipar e resolver questões tributárias respondendo a perguntas e fornecendo\r\nrecomendações quando necessário. Realizar projeções fiscais trimestrais e de\r\nfim de ano para evitar e mitigar grande quantidade de pagamentos de impostos de\r\nfim de ano.</p><p class=\"MsoNormal\" style=\"\">CARGO: Gerente de Contabilidade<o:p></o:p></p><p class=\"MsoNormal\" style=\"\">LOCAL: Santos – SP | Home\r\nOffice e Presencial – Disponibilidade de mudança <o:p></o:p></p><p class=\"MsoNormal\" style=\"\">ESCALA: horário comercial <o:p></o:p></p><p class=\"MsoNormal\" style=\"\">SALÁRIO:&nbsp;á combinar<o:p></o:p></p><p class=\"MsoNormal\" style=\"\">BENEFÍCIOS: VR/VA Alelo R$\r\n800,00; plano de saúde Bradesco/Unimed; plano odontológico; caixa bônus anual\r\nde 1 a 5 salários; gympass; seguro de vida; incentivo a idiomas; vale transporte.\r\n<o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"\">REQUISITOS:&nbsp;graduação em ciências contábeis (correlatas) - CPA obrigatório. – CRC ATIVO; experiência\r\nprofissional comprovada como gerente de contabilidade; experiência na indústria\r\nde comércio de commodities, experiência com ERP, principalmente SAP. Deve ter\r\nforte experiência com Microsoft Excel, Access e Word, conhecimento comprovado\r\nde escrituração e princípios, práticas, normas, leis e regulamentos de\r\ncontabilidade; conhecimento sobre as leis de imposto de renda e familiaridade\r\ncom diversos procedimentos tributários, inglês fluente.<o:p></o:p></p>','https://Inklua.compleo.com.br/Visualizar/90078',NULL,'GERENSUCAF',1,'Santos','SP',10473,'Paulista',NULL,NULL,'2021-07-26 22:45:15','2021-07-31 00:00:06'),(2036,18,1,NULL,'2021-07-26','Analista de Riscos Pleno',NULL,NULL,'<p class=\"MsoNormal\" style=\"\">Analisar e validar sob o ponto de\r\nvista do risco, os negócios de compra e venda de energia propostos pela área comercial, conforme os procedimentos em vigor (Limites de Risco, Preço, DOA\r\netc.) através das ferramentas de análise; monitorar e controlar os limites de\r\nriscos estabelecidos e produzir relatórios de controle e de exceção; manter e\r\natualizar a estrutura de book; monitorar as atividades comerciais e certificar\r\nque estão de acordo as regras de mercado, leis e regulação vigente; manter e\r\napoiar o aprimoramento das métricas de risco e modelos, incluindo MTM, P&amp;L,\r\nVaR e Stress Testing; manter e apoiar o aprimoramento da modelagem dos ativos e\r\nseu gerenciamento no sistema de risco; apoia e executar analise de\r\nsensibilidades “ad hoc\"; apoiar o processo de análise de crédito; apoiar o\r\nmonitoramento da exposição de crédito e controle de garantias; apoiar o\r\naprimoramento da política de risco. Assegurar a conformidade das atividades com\r\nas políticas e procedimentos: administrativos, técnicos, operacionais, do sistema de gestão ambiental (SGA), e do Safe Work Management System (SWMS).</p><p class=\"MsoNormal\" style=\"\">CARGO: Analista de Riscos\r\nPleno<o:p></o:p></p><p class=\"MsoNormal\" style=\"\">LOCAL: Brasil | home office\r\n<o:p></o:p></p><p class=\"MsoNormal\" style=\"\">ESCALA: horário comercial<o:p></o:p></p><p class=\"MsoNormal\" style=\"\">SALÁRIO:&nbsp;á combinar<o:p></o:p></p><p class=\"MsoNormal\" style=\"\">BENEFÍCIOS:&nbsp;<o:p></o:p>VA e VR; auxílio creche e babá; convênios e descontos; plano de saúde; plano odontológico; auxílio práticas esportivas; auxílio idiomas; previdência privada; seguro de vida; PLR; subsídio medicamentos;&nbsp;VT; viver bem.</p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"\">REQUISITOS:&nbsp;graduação\r\ncompleta em engenharia, economia ou administração, conhecimentos prévios no\r\nsetor de energia, Excel avançado, inglês intermediário.&nbsp;<o:p></o:p></p>','https://Inklua.compleo.com.br/Visualizar/90079',NULL,'ANRISPLELE',1,'','',10473,'Paulista',NULL,NULL,'2021-07-26 23:00:40','2021-07-31 00:00:06'),(2037,NULL,1,NULL,'2021-07-26','Empacotador',NULL,NULL,'<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"1107\" style=\"width: 830pt;\">\r\n <colgroup><col width=\"1107\" style=\"mso-width-source:userset;mso-width-alt:40484;\r\n width:830pt\">\r\n </colgroup><tbody><tr height=\"20\" style=\"height:15.0pt\">\r\n  <td height=\"20\" class=\"xl65\" width=\"1107\" style=\"height:15.0pt;width:830pt\">O\r\n  profissional realizará embalagens de produtos.<br><br></td>\r\n </tr>\r\n <tr height=\"20\" style=\"height:15.0pt\">\r\n  <td height=\"20\" class=\"xl65\" style=\"height:15.0pt;border-top:none\