 Vida&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p style=\"\">REQUISITOS:&nbsp;Ensino superior em andamento Bacharelado, tecnólogo ou Licenciatura em Ciência da Computação, Gestão da Informação ou área correlacionada. Experiência em atendimento técnico e requerimentos de usuários. Comunicação assertiva, trabalho em equipe, relacionamento interpessoal e planejamento Capacidade para gerenciar e/ou executar demandas de natureza diferentes simultaneamente, gerando resultados assertivos</p>','https://Inklua.compleo.com.br/Visualizar/90166',NULL,'90166',1,'Jandira','SP',10440,'República',NULL,NULL,'2021-07-27 18:15:06','2021-07-31 00:00:06'),(2045,NULL,3,NULL,NULL,'Idosa de 69 anos serve pães diariamente para 130 famílias carentes da Brasilândia','Inclusão','dx2RTfqyze79DSlZ2QHAO1i0iAFbV7EbK9AzlY47.jpg','<p>Com o apoio conquistado nas redes sociais, Tutu organizou uma banquinha armada na porta de casa, onde distribui&nbsp;cerca de 1,7 mil p&atilde;es e 300 litros de ch&aacute; todos os dias para uma comunidade carente.</p>','https://razoesparaacreditar.com/idosa-serve-paes-familias-carentes-sp/','Razões para acreditar',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,'2021-07-27 18:45:01','2021-07-27 18:45:01'),(2046,NULL,1,NULL,'2021-07-27','Designer Senior',NULL,NULL,'<p>Responsável pela criação de peças/ campanhas de comunicação, tais como; banners promocionais institucionais; e-mail marketing (layout e programação básica HTML); suporte para área de mídia (campanhas em motion/vídeo); publicações para redes sociais da empresa; criação de brindes institucionais, campanhas off-line (material impresso para lojas físicas); suporte&nbsp; equipe visual Merchandising na criação de visuais para os PDVs; direcionar o time e aprovar o visual das campanhas em suporte à gerente da área, interface com Trade MKT e outras áreas estratégicas para criação de campanhas.</p><p>CARGO: Designer - Sênior</p><p>LOCAL: São Paulo, SP</p><p>HORÁRIO: segunda a sexta, 09 as 18.</p><p>SALÁRIO: R$ 4.783,00</p><p>BENEFÍCIOS: assistência\r\nmédica, seguro de vida atual da empresa, vale refeição, vale transporte e\r\nGympass</p><p>REQUISITOS: ensino superior completo<span style=\"text-align: justify;\">&nbsp;em design, publicidade e propaganda e/ou áreas correlatas; c</span><span style=\"text-align: justify;\">onhecimento avançado nas\r\nrotinas relacionadas à criação de peças digitais e impressas; c</span><span style=\"text-align: justify;\">onhecimento avançado do pacote\r\nAdobe: Photoshop, Illlustrator, Dreamweaver, InDesign, Premiere (desejável),\r\nAfter Effects (desejável); e</span><span style=\"text-align: justify;\">dição/tratamento de imagens de\r\nproduto;&nbsp;</span><span style=\"text-align: justify;\">HTML intermediário (desejável); i</span><span style=\"text-align: justify;\">nglês avançado (desejável).&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><o:p></o:p></p><p><span style=\"color: rgb(85, 85, 85);\"><br></span></p><p><span style=\"color: rgb(85, 85, 85);\"><br></span><span style=\"color: rgb(85, 85, 85);\"><br></span><br></p>','https://Inklua.compleo.com.br/Visualizar/90172',NULL,'DGNSENIOR',1,'São Paulo','SP',10439,'Rio de Janeiro / Minas Gerais',NULL,NULL,'2021-07-27 18:45:06','2021-07-31 00:00:06'),(2047,NULL,1,NULL,'2021-07-27','Auxiliar Logístico',NULL,NULL,'<p>Colaborar com o planejamento dos espaços e distribuição das mercadorias</p><p><br></p><p>CARGO: Auxiliar logístico&nbsp;</p><p>LOCAL: Rio de Janeiro, RJ<br></p><p>HORÁRIO: disponibilidade para atuar em turnos&nbsp;</p><p>SALÁRIO:&nbsp;R$ 1.300,00</p><p>BENEFÍCIOS: AM+AO+Gympass+ Refeitório no\r\nLocal+ VT ou Fretado+ Seguro de Vida+PPR.</p><p>REQUISITOS: ensino fundamental completo.</p><p><br></p>','https://Inklua.compleo.com.br/Visualizar/90184',NULL,'AUXLOGRJ',1,'Rio de Janeiro','RJ',10439,'Rio de Janeiro / Minas Gerais',NULL,NULL,'2021