 que englobe aspectos do WCM/Leans, ISO (9001 e 14001) e metodologias, práticas e ferramentas de inovação.<br></p><p>Cargo: Assistente de Programa de Melhorias<br></p><p>Salario: R$ 2.348,00&nbsp;<br></p><p>Benefícios:&nbsp;assistência médica, assistência odontológica, auxílio farmácia, refeição no local, vale transporte / transporte fretado,&nbsp; cesta básica mensal, previdência privada, cesta de natal.&nbsp;<br></p><p>Local: Vinhedo/SP</p><p>Horário: Comercial - Segunda a sexta-feira</p><p>Requisitos: Superior cursando em: Administração, Engenharia, Biologia, Química. Inglês&nbsp;básico, experiência anterior na função. Desejável: curso de interpretação das normas ISO 9001 e 14001, curso de ferramentas de análise de causa, curso de metodologias de inovação, curso de lean/wcm/six sigma. Conhecimentos específicos: Sistema de Gestão da Qualidade e Meio Ambiente com base nas normas ISO 9001 e 14001, sistemas de Melhoria Contínua (Lean, WCM), ferramentas de análise de causa (ex.: Ishikawa, 5 porque, 5W2H), conceitos de 5S, ferramentas do Pacote Office em nível intermediário e projetos de Melhoria (PDCA e Kaizens).</p></div></div>','https://Inklua.compleo.com.br/Visualizar/90186',NULL,'SAINTGVINH',1,'Vinhedo','SP',10441,'Jundiaí',NULL,NULL,'2021-07-27 19:30:07','2021-07-31 00:00:06'),(2050,NULL,1,NULL,'2021-07-13','Operador de Loja',NULL,NULL,'<p></p><p></p><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"823\" style=\"width: 617pt;\"><tbody><tr height=\"20\" style=\"height:15.0pt\"><td height=\"20\" class=\"xl65\" style=\"height:15.0pt;border-top:none\"><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"823\" style=\"box-sizing: border-box; outline: none !important; border-collapse: collapse; border-spacing: 0px; max-width: 100%; background-color: transparent; width: 617pt;\"><colgroup style=\"box-sizing: border-box; outline: none !important;\"><col width=\"823\" style=\"box-sizing: border-box; outline: none !important; width: 617pt;\"></col